('http://schema.org/FDAcategoryA', 'FDAcategoryA', 'A designation by the US FDA signifying that adequate and well-controlled studies have failed to demonstrate a risk to the fetus in the first trimester of pregnancy (and there is no evidence of risk in later trimesters).', 'http://schema.org/DrugPregnancyCategory', '', '', 'http://health-lifesci.schema.org'),
('http://schema.org/FDAcategoryB', 'FDAcategoryB', 'A designation by the US FDA signifying that animal reproduction studies have failed to demonstrate a risk to the fetus and there are no adequate and well-controlled studies in pregnant women.', 'http://schema.org/DrugPregnancyCategory', '', '', 'http://health-lifesci.schema.org'),
('http://schema.org/FDAcategoryC', 'FDAcategoryC', 'A designation by the US FDA signifying that animal reproduction studies have shown an adverse effect on the fetus and there are no adequate and well-controlled studies in humans, but potential benefits may warrant use of the drug in pregnant women despite potential risks.', 'http://schema.org/DrugPregnancyCategory', '', '', 'http://health-lifesci.schema.org'),
('http://schema.org/FDAcategoryD', 'FDAcategoryD', 'A designation by the US FDA signifying that there is positive evidence of human fetal risk based on adverse reaction data from investigational or marketing experience or studies in humans, but potential benefits may warrant use of the drug in pregnant women despite potential risks.', 'http://schema.org/DrugPregnancyCategory', '', '', 'http://health-lifesci.schema.org'),
('http://schema.org/FDAcategoryX', 'FDAcategoryX', 'A designation by the US FDA signifying that studies in animals or humans have demonstrated fetal abnormalities and/or there is positive evidence of human fetal risk based on adverse reaction data from investigational or marketing experience, and the risks involved in use of the drug in pregnant women clearly outweigh potential benefits.', 'http://schema.org/DrugPregnancyCategory', '', '', 'http://health-lifesci.schema.org'),
