(19, 'http://schema.org/CaseSeries', 'CaseSeries', 'Series de casos', 'A case series (also known as a clinical series) is a medical research study that tracks patients with a known exposure given similar treatment or examines their medical records for exposure and outcome. A case series can be retrospective or prospective and usually involves a smaller number of patients than the more powerful case-control studies or randomized controlled trials. Case series may be consecutive or non-consecutive, depending on whether all cases presenting to the reporting authors over a period of time were included, or only a selection.', 'http://schema.org/MedicalObservationalStudyDesign', '', '', 'http://health-lifesci.schema.org'),
(20, 'http://schema.org/CassetteFormat', 'CassetteFormat', 'Formato del cassette', 'CassetteFormat.', 'http://schema.org/MusicReleaseFormatType', '', '', ''),
(21, 'http://schema.org/Chiropractic', 'Chiropractic', 'QuiroprÃ¡ctica', 'A system of medicine focused on the relationship between the body\'s structure, mainly the spine, and its functioning.', 'http://schema.org/MedicineSystem', '', '', 'http://health-lifesci.schema.org'),
(22, 'http://schema.org/Clinician', 'Clinician', 'ClÃ­nico', 'Medical clinicians, including practicing physicians and other medical professionals involved in clinical practice.', 'http://schema.org/MedicalAudience', '', '', 'http://health-lifesci.schema.org'),
