(162, 'http://schema.org/PercutaneousProcedure', 'PercutaneousProcedure', 'Procedimiento percutÃ¡neo', 'A type of medical procedure that involves percutaneous techniques, where access to organs or tissue is achieved via needle-puncture of the skin. For example, catheter-based procedures like stent delivery.', 'http://schema.org/MedicalProcedureType', '', '', 'http://health-lifesci.schema.org'),
