(179, 'http://schema.org/Radiography', 'Radiography', 'RadiografÃ­a', 'Radiography is an imaging technique that uses electromagnetic radiation other than visible light, especially X-rays, to view the internal structure of a non-uniformly composed and opaque object such as the human body.', 'http://schema.org/MedicalImagingTechnique', '', '', 'http://health-lifesci.schema.org'),
