INSERT INTO `properties` (`id`, `label`, `comment`, `subPropertyOf`, `equivalentProperty`, `subproperties`, `domainIncludes`, `rangeIncludes`, `inversOf`, `supersedes`, `supersededBy`) VALUES
('http://schema.org/about', 'about', 'The subject matter of the content.', '', '', '', 'http://schema.org/CommunicateAction, http://schema.org/CreativeWork, http://schema.org/Event', 'http://schema.org/Thing', '', '', ''),
('http://schema.org/abridged', 'abridged', 'Indicates whether the book is an abridged edition.', '', '', '', 'http://schema.org/Book', 'http://schema.org/Boolean', '', '', ''),
('http://schema.org/accelerationTime', 'accelerationTime', '<p>The time needed to accelerate the vehicle from a given start velocity to a given target velocity.</p>\n\n<p>Typical unit code(s): SEC for seconds</p>\n\n<ul>\n<li>Note: There are unfortunately no standard unit codes for seconds/0..100 km/h or seconds/0..60 mph. Simply use \"SEC\" for seconds and indicate the velocities in the <a class=\"localLink\" href=\"http://schema.org/name\">name</a> of the <a class=\"localLink\" href=\"http://schema.org/QuantitativeValue\">QuantitativeValue</a>, or use <a class=\"localLink\" href=\"http://schema.org/valueReference\">valueReference</a> with a <a class=\"localLink\" href=\"http://schema.org/QuantitativeValue\">QuantitativeValue</a> of 0..60 mph or 0..100 km/h to specify the reference speeds.</li>\n</ul>\n', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/QuantitativeValue', '', '', ''),
('http://schema.org/acceptedAnswer', 'acceptedAnswer', 'The answer that has been accepted as best, typically on a Question/Answer site. Sites vary in their selection mechanisms, e.g. drawing on community opinion and/or the view of the Question author.', 'http://schema.org/suggestedAnswer', '', '', 'http://schema.org/Question', 'http://schema.org/Answer', '', '', ''),
('http://schema.org/acceptedOffer', 'acceptedOffer', 'The offer(s) -- e.g., product, quantity and price combinations -- included in the order.', '', '', '', 'http://schema.org/Order', 'http://schema.org/Offer', '', '', ''),
('http://schema.org/acceptedPaymentMethod', 'acceptedPaymentMethod', 'The payment method(s) accepted by seller for this offer.', '', '', '', 'http://schema.org/Demand, http://schema.org/Offer', 'http://schema.org/LoanOrCredit, http://schema.org/PaymentMethod', '', '', ''),
('http://schema.org/acceptsReservations', 'acceptsReservations', 'Indicates whether a FoodEstablishment accepts reservations. Values can be Boolean, an URL at which reservations can be made or (for backwards compatibility) the strings <code>Yes</code> or <code>No</code>.', '', '', '', 'http://schema.org/FoodEstablishment', 'http://schema.org/Boolean, http://schema.org/Text, http://schema.org/URL', '', '', ''),
('http://schema.org/accessCode', 'accessCode', 'Password, PIN, or access code needed for delivery (e.g. from a locker).', '', '', '', 'http://schema.org/DeliveryEvent', 'http://schema.org/Text', '', '', ''),
('http://schema.org/accessMode', 'accessMode', 'The human sensory perceptual system or cognitive faculty through which a person may process or perceive information. Expected values include: auditory, tactile, textual, visual, colorDependent, chartOnVisual, chemOnVisual, diagramOnVisual, mathOnVisual, musicOnVisual, textOnVisual.', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/Text', '', '', ''),
('http://schema.org/accessModeSufficient', 'accessModeSufficient', 'A list of single or combined accessModes that are sufficient to understand all the intellectual content of a resource. Expected values include:  auditory, tactile, textual, visual.', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/Text', '', '', ''),
('http://schema.org/accessibilityAPI', 'accessibilityAPI', 'Indicates that the resource is compatible with the referenced accessibility API (<a href=\"http://www.w3.org/wiki/WebSchemas/Accessibility\">WebSchemas wiki lists possible values</a>).', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/Text', '', '', ''),
('http://schema.org/accessibilityControl', 'accessibilityControl', 'Identifies input methods that are sufficient to fully control the described resource (<a href=\"http://www.w3.org/wiki/WebSchemas/Accessibility\">WebSchemas wiki lists possible values</a>).', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/Text', '', '', ''),
('http://schema.org/accessibilityFeature', 'accessibilityFeature', 'Content features of the resource, such as accessible media, alternatives and supported enhancements for accessibility (<a href=\"http://www.w3.org/wiki/WebSchemas/Accessibility\">WebSchemas wiki lists possible values</a>).', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/Text', '', '', ''),
('http://schema.org/accessibilityHazard', 'accessibilityHazard', 'A characteristic of the described resource that is physiologically dangerous to some users. Related to WCAG 2.0 guideline 2.3 (<a href=\"http://www.w3.org/wiki/WebSchemas/Accessibility\">WebSchemas wiki lists possible values</a>).', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/Text', '', '', ''),
('http://schema.org/accessibilitySummary', 'accessibilitySummary', 'A human-readable summary of specific accessibility features or deficiencies, consistent with the other accessibility metadata but expressing subtleties such as \"short descriptions are present but long descriptions will be needed for non-visual users\" or \"short descriptions are present and no long descriptions are needed.\"', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/Text', '', '', ''),
