('http://schema.org/editor', 'editor', 'Specifies the Person who edited the CreativeWork.', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/Person', '', '', ''),
('http://schema.org/educationRequirements', 'educationRequirements', 'Educational background needed for the position.', '', '', '', 'http://schema.org/JobPosting', 'http://schema.org/Text', '', '', ''),
