('http://schema.org/educationalUse', 'educationalUse', 'The purpose of a work in the context of education; for example, \'assignment\', \'group work\'.', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/Text', '', '', ''),
('http://schema.org/elevation', 'elevation', 'The elevation of a location (<a href=\"https://en.wikipedia.org/wiki/World_Geodetic_System\">WGS 84</a>).', '', '', '', 'http://schema.org/GeoCoordinates, http://schema.org/GeoShape', 'http://schema.org/Number, http://schema.org/Text', '', '', ''),
('http://schema.org/eligibleCustomerType', 'eligibleCustomerType', 'The type(s) of customers for which the given offer is valid.', '', '', '', 'http://schema.org/Demand, http://schema.org/Offer', 'http://schema.org/BusinessEntityType', '', '', ''),
('http://schema.org/eligibleDuration', 'eligibleDuration', 'The duration for which the given offer is valid.', '', '', '', 'http://schema.org/Demand, http://schema.org/Offer', 'http://schema.org/QuantitativeValue', '', '', ''),
('http://schema.org/eligibleQuantity', 'eligibleQuantity', 'The interval and unit of measurement of ordering quantities for which the offer or price specification is valid. This allows e.g. specifying that a certain freight charge is valid only for a certain quantity.', '', '', '', 'http://schema.org/Demand, http://schema.org/Offer, http://schema.org/PriceSpecification', 'http://schema.org/QuantitativeValue', '', '', ''),
('http://schema.org/eligibleRegion', 'eligibleRegion', 'The ISO 3166-1 (ISO 3166-1 alpha-2) or ISO 3166-2 code, the place, or the GeoShape for the geo-political region(s) for which the offer or delivery charge specification is valid.</p>\n\n<p>See also <a class=\"localLink\" href=\"http://schema.org/ineligibleRegion\">ineligibleRegion</a>.', 'http://schema.org/areaServed', '', '', 'http://schema.org/DeliveryChargeSpecification, http://schema.org/Demand, http://schema.org/Offer', 'http://schema.org/GeoShape, http://schema.org/Place, http://schema.org/Text', '', '', ''),
('http://schema.org/eligibleTransactionVolume', 'eligibleTransactionVolume', 'The transaction volume, in a monetary unit, for which the offer or price specification is valid, e.g. for indicating a minimal purchasing volume, to express free shipping above a certain order volume, or to limit the acceptance of credit cards to purchases to a certain minimal amount.', '', '', '', 'http://schema.org/Demand, http://schema.org/Offer, http://schema.org/PriceSpecification', 'http://schema.org/PriceSpecification', '', '', ''),
('http://schema.org/email', 'email', 'Email address.', '', '', '', 'http://schema.org/ContactPoint, http://schema.org/Organization, http://schema.org/Person', 'http://schema.org/Text', '', '', ''),
('http://schema.org/embedUrl', 'embedUrl', 'A URL pointing to a player for a specific video. In general, this is the information in the <code>src</code> element of an <code>embed</code> tag and should not be the same as the content of the <code>loc</code> tag.', '', '', '', 'http://schema.org/MediaObject', 'http://schema.org/URL', '', '', ''),
('http://schema.org/emissionsCO2', 'emissionsCO2', 'The CO2 emissions in g/km. When used in combination with a QuantitativeValue, put \"g/km\" into the unitText property of that value, since there is no UN/CEFACT Common Code for \"g/km\".', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/Number', '', '', ''),
('http://schema.org/employee', 'employee', 'Someone working for this organization.', '', '', '', 'http://schema.org/Organization', 'http://schema.org/Person', '', 'http://schema.org/employees', ''),
