('http://schema.org/employmentType', 'employmentType', 'Type of employment (e.g. full-time, part-time, contract, temporary, seasonal, internship).', '', '', '', 'http://schema.org/JobPosting', 'http://schema.org/Text', '', '', ''),
('http://schema.org/encodesCreativeWork', 'encodesCreativeWork', 'The CreativeWork encoded by this media object.', '', '', '', 'http://schema.org/MediaObject', 'http://schema.org/CreativeWork', '', '', ''),
('http://schema.org/encoding', 'encoding', 'A media object that encodes this CreativeWork. This property is a synonym for associatedMedia.', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/MediaObject', '', 'http://schema.org/encodings', ''),
('http://schema.org/encodingFormat', 'encodingFormat', 'mp3, mpeg4, etc.', '', '', '', 'http://schema.org/MediaObject', 'http://schema.org/Text', '', '', ''),
