('http://schema.org/endDate', 'endDate', 'The end date and time of the item (in <a href=\"http://en.wikipedia.org/wiki/ISO_8601\">ISO 8601 date format</a>).', '', '', '', 'http://schema.org/CreativeWorkSeason, http://schema.org/CreativeWorkSeries, http://schema.org/DatedMoneySpecification, http://schema.org/Event, http://schema.org/Role', 'http://schema.org/Date, http://schema.org/DateTime', '', '', ''),
('http://schema.org/endTime', 'endTime', 'The endTime of something. For a reserved event or service (e.g. FoodEstablishmentReservation), the time that it is expected to end. For actions that span a period of time, when the action was performed. e.g. John wrote a book from January to <em>December</em>.</p>\n\n<p>Note that Event uses startDate/endDate instead of startTime/endTime, even when describing dates with times. This situation may be clarified in future revisions.', '', '', '', 'http://schema.org/Action, http://schema.org/FoodEstablishmentReservation', 'http://schema.org/DateTime', '', '', ''),
('http://schema.org/endorsee', 'endorsee', 'A sub property of participant. The person/organization being supported.', 'http://schema.org/participant', '', '', 'http://schema.org/EndorseAction', 'http://schema.org/Organization, http://schema.org/Person', '', '', ''),
('http://schema.org/endorsers', 'endorsers', 'People or organizations that endorse the plan.', '', '', '', 'http://schema.org/Diet', 'http://schema.org/Organization, http://schema.org/Person', '', '', ''),
('http://schema.org/engineDisplacement', 'engineDisplacement', 'The volume swept by all of the pistons inside the cylinders of an internal combustion engine in a single movement. </p>\n\n<p>Typical unit code(s): CMQ for cubic centimeter, LTR for liters, INQ for cubic inches\n* Note 1: You can link to information about how the given value has been determined using the <a class=\"localLink\" href=\"http://schema.org/valueReference\">valueReference</a> property.\n* Note 2: You can use <a class=\"localLink\" href=\"http://schema.org/minValue\">minValue</a> and <a class=\"localLink\" href=\"http://schema.org/maxValue\">maxValue</a> to indicate ranges.', '', '', '', 'http://schema.org/EngineSpecification', 'http://schema.org/QuantitativeValue', '', '', ''),
('http://schema.org/enginePower', 'enginePower', '<p>The power of the vehicle\'s engine.\n    Typical unit code(s): KWT for kilowatt, BHP for brake horsepower, N12 for metric horsepower (PS, with 1 PS = 735,49875 W)</p>\n\n<ul>\n<li>Note 1: There are many different ways of measuring an engine\'s power. For an overview, see  <a href=\"http://en.wikipedia.org/wiki/Horsepower#Engine_power_test_codes\">http://en.wikipedia.org/wiki/Horsepower#Engine<em>power</em>test_codes</a>.</li>\n<li>Note 2: You can link to information about how the given value has been determined using the <a class=\"localLink\" href=\"http://schema.org/valueReference\">valueReference</a> property.</li>\n<li>Note 3: You can use <a class=\"localLink\" href=\"http://schema.org/minValue\">minValue</a> and <a class=\"localLink\" href=\"http://schema.org/maxValue\">maxValue</a> to indicate ranges.</li>\n</ul>\n', '', '', '', 'http://schema.org/EngineSpecification', 'http://schema.org/QuantitativeValue', '', '', '');
