('http://schema.org/featureList', 'featureList', 'Features or modules provided by this application (and possibly required by other applications).', '', '', '', 'http://schema.org/SoftwareApplication', 'http://schema.org/Text, http://schema.org/URL', '', '', ''),
('http://schema.org/feesAndCommissionsSpecification', 'feesAndCommissionsSpecification', 'Description of fees, commissions, and other terms applied either to a class of financial product, or by a financial service organization.', '', '', '', 'http://schema.org/FinancialProduct, http://schema.org/FinancialService', 'http://schema.org/Text, http://schema.org/URL', '', '', ''),
('http://schema.org/fiberContent', 'fiberContent', 'The number of grams of fiber.', '', '', '', 'http://schema.org/NutritionInformation', 'http://schema.org/Mass', '', '', ''),
('http://schema.org/fileFormat', 'fileFormat', 'Media type, typically MIME format (see <a href=\"http://www.iana.org/assignments/media-types/media-types.xhtml\">IANA site</a>) of the content e.g. application/zip of a SoftwareApplication binary. In cases where a CreativeWork has several media type representations, \'encoding\' can be used to indicate each MediaObject alongside particular fileFormat information. Unregistered or niche file formats can be indicated instead via the most appropriate URL, e.g. defining Web page or a Wikipedia entry.', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/Text, http://schema.org/URL', '', '', ''),
('http://schema.org/fileSize', 'fileSize', 'Size of the application / package (e.g. 18MB). In the absence of a unit (MB, KB etc.), KB will be assumed.', '', '', '', 'http://schema.org/SoftwareApplication', 'http://schema.org/Text', '', '', ''),
('http://schema.org/firstPerformance', 'firstPerformance', 'The date and place the work was first performed.', '', '', '', 'http://schema.org/MusicComposition', 'http://schema.org/Event', '', '', ''),
('http://schema.org/flightDistance', 'flightDistance', 'The distance of the flight.', '', '', '', 'http://schema.org/Flight', 'http://schema.org/Distance, http://schema.org/Text', '', '', ''),
('http://schema.org/flightNumber', 'flightNumber', 'The unique identifier for a flight including the airline IATA code. For example, if describing United flight 110, where the IATA code for United is \'UA\', the flightNumber is \'UA110\'.', 'http://schema.org/identifier', '', '', 'http://schema.org/Flight', 'http://schema.org/Text', '', '', ''),
('http://schema.org/floorLimit', 'floorLimit', 'A floor limit is the amount of money above which credit card transactions must be authorized.', '', '', '', 'http://schema.org/PaymentCard', 'http://schema.org/MonetaryAmount', '', '', ''),
('http://schema.org/floorSize', 'floorSize', 'The size of the accommodation, e.g. in square meter or squarefoot.\nTypical unit code(s): MTK for square meter, FTK for square foot, or YDK for square yard', '', '', '', 'http://schema.org/Accommodation', 'http://schema.org/QuantitativeValue', '', '', ''),
('http://schema.org/followee', 'followee', 'A sub property of object. The person or organization being followed.', 'http://schema.org/object', '', '', 'http://schema.org/FollowAction', 'http://schema.org/Organization, http://schema.org/Person', '', '', ''),
