('http://schema.org/foodEstablishment', 'foodEstablishment', 'A sub property of location. The specific food establishment where the action occurred.', 'http://schema.org/location', '', '', 'http://schema.org/CookAction', 'http://schema.org/FoodEstablishment, http://schema.org/Place', '', '', ''),
('http://schema.org/foodEvent', 'foodEvent', 'A sub property of location. The specific food event where the action occurred.', 'http://schema.org/location', '', '', 'http://schema.org/CookAction', 'http://schema.org/FoodEvent', '', '', ''),
('http://schema.org/foodWarning', 'foodWarning', 'Any precaution, guidance, contraindication, etc. related to consumption of specific foods while taking this drug.', '', '', '', 'http://schema.org/Drug', 'http://schema.org/Text', '', '', ''),
('http://schema.org/founder', 'founder', 'A person who founded this organization.', '', '', '', 'http://schema.org/Organization', 'http://schema.org/Person', '', 'http://schema.org/founders', ''),
