('http://schema.org/free', 'free', 'A flag to signal that the publication or event is accessible for free.', '', '', '', 'http://schema.org/PublicationEvent', 'http://schema.org/Boolean', '', '', 'http://schema.org/isAccessibleForFree'),
('http://schema.org/frequency', 'frequency', 'How often the dose is taken, e.g. \'daily\'.', '', '', '', 'http://schema.org/DoseSchedule', 'http://schema.org/Text', '', '', ''),
('http://schema.org/fromLocation', 'fromLocation', 'A sub property of location. The original location of the object or the agent before the action.', 'http://schema.org/location', '', '', 'http://schema.org/ExerciseAction, http://schema.org/MoveAction, http://schema.org/TransferAction', 'http://schema.org/Place', '', '', ''),
('http://schema.org/fuelCapacity', 'fuelCapacity', 'The capacity of the fuel tank or in the case of electric cars, the battery. If there are multiple components for storage, this should indicate the total of all storage of the same type.</p>\n\n<p>Typical unit code(s): LTR for liters, GLL of US gallons, GLI for UK / imperial gallons, AMH for ampere-hours (for electrical vehicles).', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/QuantitativeValue', '', '', ''),
('http://schema.org/fuelConsumption', 'fuelConsumption', '<p>The amount of fuel consumed for traveling a particular distance or temporal duration with the given vehicle (e.g. liters per 100 km).</p>\n\n<ul>\n<li>Note 1: There are unfortunately no standard unit codes for liters per 100 km.  Use <a class=\"localLink\" href=\"http://schema.org/unitText\">unitText</a> to indicate the unit of measurement, e.g. L/100 km.</li>\n<li>Note 2: There are two ways of indicating the fuel consumption, <a class=\"localLink\" href=\"http://schema.org/fuelConsumption\">fuelConsumption</a> (e.g. 8 liters per 100 km) and <a class=\"localLink\" href=\"http://schema.org/fuelEfficiency\">fuelEfficiency</a> (e.g. 30 miles per gallon). They are reciprocal.</li>\n<li>Note 3: Often, the absolute value is useful only when related to driving speed (\"at 80 km/h\") or usage pattern (\"city traffic\"). You can use <a class=\"localLink\" href=\"http://schema.org/valueReference\">valueReference</a> to link the value for the fuel consumption to another value.</li>\n</ul>\n', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/QuantitativeValue', '', '', ''),
('http://schema.org/fuelEfficiency', 'fuelEfficiency', '<p>The distance traveled per unit of fuel used; most commonly miles per gallon (mpg) or kilometers per liter (km/L).</p>\n\n<ul>\n<li>Note 1: There are unfortunately no standard unit codes for miles per gallon or kilometers per liter. Use <a class=\"localLink\" href=\"http://schema.org/unitText\">unitText</a> to indicate the unit of measurement, e.g. mpg or km/L.</li>\n<li>Note 2: There are two ways of indicating the fuel consumption, <a class=\"localLink\" href=\"http://schema.org/fuelConsumption\">fuelConsumption</a> (e.g. 8 liters per 100 km) and <a class=\"localLink\" href=\"http://schema.org/fuelEfficiency\">fuelEfficiency</a> (e.g. 30 miles per gallon). They are reciprocal.</li>\n<li>Note 3: Often, the absolute value is useful only when related to driving speed (\"at 80 km/h\") or usage pattern (\"city traffic\"). You can use <a class=\"localLink\" href=\"http://schema.org/valueReference\">valueReference</a> to link the value for the fuel economy to another value.</li>\n</ul>\n', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/QuantitativeValue', '', '', ''),
('http://schema.org/fuelType', 'fuelType', 'The type of fuel suitable for the engine or engines of the vehicle. If the vehicle has only one engine, this property can be attached directly to the vehicle.', '', '', '', 'http://schema.org/EngineSpecification, http://schema.org/Vehicle', 'http://schema.org/QualitativeValue, http://schema.org/Text, http://schema.org/URL', '', '', ''),
