('http://schema.org/interactionType', 'interactionType', 'The Action representing the type of interaction. For up votes, +1s, etc. use <a class=\"localLink\" href=\"http://schema.org/LikeAction\">LikeAction</a>. For down votes use <a class=\"localLink\" href=\"http://schema.org/DislikeAction\">DislikeAction</a>. Otherwise, use the most specific Action.', '', '', '', 'http://schema.org/InteractionCounter', 'http://schema.org/Action', '', '', ''),
