('http://schema.org/maximumAttendeeCapacity', 'maximumAttendeeCapacity', 'The total number of individuals that may attend an event or venue.', '', '', '', 'http://schema.org/Event, http://schema.org/Place', 'http://schema.org/Integer', '', '', ''),
('http://schema.org/maximumIntake', 'maximumIntake', 'Recommended intake of this supplement for a given population as defined by a specific recommending authority.', '', '', '', 'http://schema.org/DietarySupplement, http://schema.org/Drug, http://schema.org/DrugStrength, http://schema.org/Substance', 'http://schema.org/MaximumDoseSchedule', '', '', ''),
('http://schema.org/mealService', 'mealService', 'Description of the meals that will be provided or available for purchase.', '', '', '', 'http://schema.org/Flight', 'http://schema.org/Text', '', '', ''),
('http://schema.org/measurementTechnique', 'measurementTechnique', 'A technique or technology used in a <a class=\"localLink\" href=\"http://schema.org/Dataset\">Dataset</a> (or <a class=\"localLink\" href=\"http://schema.org/DataDownload\">DataDownload</a>, <a class=\"localLink\" href=\"http://schema.org/DataCatalog\">DataCatalog</a>),\ncorresponding to the method used for measuring the corresponding variable(s) (described using <a class=\"localLink\" href=\"http://schema.org/variableMeasured\">variableMeasured</a>). This is oriented towards scientific and scholarly dataset publication but may have broader applicability; it is not intended as a full representation of measurement, but rather as a high level summary for dataset discovery.</p>\n\n<p>For example, if <a class=\"localLink\" href=\"http://schema.org/variableMeasured\">variableMeasured</a> is: molecule concentration, <a class=\"localLink\" href=\"http://schema.org/measurementTechnique\">measurementTechnique</a> could be: \"mass spectrometry\" or \"nmr spectroscopy\" or \"colorimetry\" or \"immunofluorescence\".</p>\n\n<p>If the <a class=\"localLink\" href=\"http://schema.org/variableMeasured\">variableMeasured</a> is \"depression rating\", the <a class=\"localLink\" href=\"http://schema.org/measurementTechnique\">measurementTechnique</a> could be \"Zung Scale\" or \"HAM-D\" or \"Beck Depression Inventory\".</p>\n\n<p>If there are several <a class=\"localLink\" href=\"http://schema.org/variableMeasured\">variableMeasured</a> properties recorded for some given data object, use a <a class=\"localLink\" href=\"http://schema.org/PropertyValue\">PropertyValue</a> for each <a class=\"localLink\" href=\"http://schema.org/variableMeasured\">variableMeasured</a> and attach the corresponding <a class=\"localLink\" href=\"http://schema.org/measurementTechnique\">measurementTechnique</a>.', '', '', '', 'http://schema.org/DataCatalog, http://schema.org/DataDownload, http://schema.org/Dataset, http://schema.org/PropertyValue', 'http://schema.org/Text, http://schema.org/URL', '', '', ''),
('http://schema.org/mechanismOfAction', 'mechanismOfAction', 'The specific biochemical interaction through which this drug or supplement produces its pharmacological effect.', '', '', '', 'http://schema.org/DietarySupplement, http://schema.org/Drug', 'http://schema.org/Text', '', '', ''),
('http://schema.org/medicalSpecialty', 'medicalSpecialty', 'A medical specialty of the provider.', '', '', '', 'http://schema.org/Hospital, http://schema.org/MedicalClinic, http://schema.org/MedicalOrganization, http://schema.org/Physician', 'http://schema.org/MedicalSpecialty', '', '', ''),
('http://schema.org/medicineSystem', 'medicineSystem', 'The system of medicine that includes this MedicalEntity, for example \'evidence-based\', \'homeopathic\', \'chiropractic\', etc.', '', '', '', 'http://schema.org/MedicalEntity', 'http://schema.org/MedicineSystem', '', '', ''),
('http://schema.org/meetsEmissionStandard', 'meetsEmissionStandard', 'Indicates that the vehicle meets the respective emission standard.', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/QualitativeValue, http://schema.org/Text, http://schema.org/URL', '', '', ''),
('http://schema.org/member', 'member', 'A member of an Organization or a ProgramMembership. Organizations can be members of organizations; ProgramMembership is typically for individuals.', '', '', '', 'http://schema.org/Organization, http://schema.org/ProgramMembership', 'http://schema.org/Organization, http://schema.org/Person', 'http://schema.org/memberOf', 'http://schema.org/members, http://schema.org/musicGroupMember', ''),
