('http://schema.org/numberOfAxles', 'numberOfAxles', 'The number of axles.</p>\n\n<p>Typical unit code(s): C62', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/Number, http://schema.org/QuantitativeValue', '', '', ''),
('http://schema.org/numberOfBeds', 'numberOfBeds', 'The quantity of the given bed type available in the HotelRoom, Suite, House, or Apartment.', '', '', '', 'http://schema.org/BedDetails', 'http://schema.org/Number', '', '', ''),
