('http://schema.org/numberOfEpisodes', 'numberOfEpisodes', 'The number of episodes in this season or series.', '', '', '', 'http://schema.org/CreativeWorkSeason, http://schema.org/RadioSeries, http://schema.org/TVSeries, http://schema.org/VideoGameSeries', 'http://schema.org/Integer', '', '', ''),
('http://schema.org/numberOfForwardGears', 'numberOfForwardGears', 'The total number of forward gears available for the transmission system of the vehicle.</p>\n\n<p>Typical unit code(s): C62', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/Number, http://schema.org/QuantitativeValue', '', '', ''),
('http://schema.org/numberOfItems', 'numberOfItems', 'The number of items in an ItemList. Note that some descriptions might not fully describe all items in a list (e.g., multi-page pagination); in such cases, the numberOfItems would be for the entire list.', '', '', '', 'http://schema.org/ItemList', 'http://schema.org/Integer', '', '', ''),
('http://schema.org/numberOfLoanPayments', 'numberOfLoanPayments', 'The number of payments contractually required at origination to repay the loan. For monthly paying loans this is the number of months from the contractual first payment date to the maturity date.', '', '', '', 'http://schema.org/RepaymentSpecification', 'http://schema.org/Number', '', '', ''),
