('http://schema.org/numberOfPlayers', 'numberOfPlayers', 'Indicate how many people can play this game (minimum, maximum, or range).', '', '', '', 'http://schema.org/Game, http://schema.org/VideoGameSeries', 'http://schema.org/QuantitativeValue', '', '', ''),
('http://schema.org/numberOfPreviousOwners', 'numberOfPreviousOwners', 'The number of owners of the vehicle, including the current one.</p>\n\n<p>Typical unit code(s): C62', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/Number, http://schema.org/QuantitativeValue', '', '', ''),
('http://schema.org/numberOfRooms', 'numberOfRooms', 'The number of rooms (excluding bathrooms and closets) of the acccommodation or lodging business.\nTypical unit code(s): ROM for room or C62 for no unit. The type of room can be put in the unitText property of the QuantitativeValue.', '', '', '', 'http://schema.org/Accommodation, http://schema.org/Apartment, http://schema.org/House, http://schema.org/SingleFamilyResidence, http://schema.org/Suite', 'http://schema.org/Number, http://schema.org/QuantitativeValue', '', '', ''),
('http://schema.org/numberOfSeasons', 'numberOfSeasons', 'The number of seasons in this series.', '', '', '', 'http://schema.org/RadioSeries, http://schema.org/TVSeries, http://schema.org/VideoGameSeries', 'http://schema.org/Integer', '', '', ''),
('http://schema.org/numberedPosition', 'numberedPosition', 'A number associated with a role in an organization, for example, the number on an athlete\'s jersey.', '', '', '', 'http://schema.org/OrganizationRole', 'http://schema.org/Number', '', '', ''),
('http://schema.org/nutrition', 'nutrition', 'Nutrition information about the recipe or menu item.', '', '', '', 'http://schema.org/MenuItem, http://schema.org/Recipe', 'http://schema.org/NutritionInformation', '', '', ''),
('http://schema.org/object', 'object', 'The object upon which the action is carried out, whose state is kept intact or changed. Also known as the semantic roles patient, affected or undergoer (which change their state) or theme (which doesn\'t). e.g. John read <em>a book</em>.', '', '', 'http://schema.org/actionOption, http://schema.org/candidate, http://schema.org/collection, http://schema.org/followee, http://schema.org/option, http://schema.org/question, http://schema.org/replacee, http://schema.org/replacer, http://schema.org/targetCollection', 'http://schema.org/Action', 'http://schema.org/Thing', '', '', ''),
('http://schema.org/occupancy', 'occupancy', 'The allowed total occupancy for the accommodation in persons (including infants etc). For individual accommodations, this is not necessarily the legal maximum but defines the permitted usage as per the contractual agreement (e.g. a double room used by a single person).\nTypical unit code(s): C62 for person', '', '', '', 'http://schema.org/Apartment, http://schema.org/HotelRoom, http://schema.org/SingleFamilyResidence, http://schema.org/Suite', 'http://schema.org/QuantitativeValue', '', '', ''),
('http://schema.org/occupationalCategory', 'occupationalCategory', 'Category or categories describing the job. Use BLS O*NET-SOC taxonomy: http://www.onetcenter.org/taxonomy.html. Ideally includes textual label and formal code, with the property repeated for each applicable value.', '', '', '', 'http://schema.org/JobPosting', 'http://schema.org/Text', '', '', ''),
('http://schema.org/offerCount', 'offerCount', 'The number of offers for the product.', '', '', '', 'http://schema.org/AggregateOffer', 'http://schema.org/Integer', '', '', ''),
('http://schema.org/offeredBy', 'offeredBy', 'A pointer to the organization or person making the offer.', '', '', '', 'http://schema.org/Offer', 'http://schema.org/Organization, http://schema.org/Person', 'http://schema.org/makesOffer', '', ''),
('http://schema.org/offers', 'offers', 'An offer to provide this item&#x2014;for example, an offer to sell a product, rent the DVD of a movie, perform a service, or give away tickets to an event.', '', '', '', 'http://schema.org/AggregateOffer, http://schema.org/CreativeWork, http://schema.org/Event, http://schema.org/MenuItem, http://schema.org/Product, http://schema.org/Service', 'http://schema.org/Offer', '', '', ''),
('http://schema.org/offersPrescriptionByMail', 'offersPrescriptionByMail', 'Whether prescriptions can be delivered by mail.', '', '', '', 'http://schema.org/HealthPlanFormulary', 'http://schema.org/Boolean', '', '', ''),
('http://schema.org/openingHours', 'openingHours', '<p>The general opening hours for a business. Opening hours can be specified as a weekly time range, starting with days, then times per day. Multiple days can be listed with commas \',\' separating each day. Day or time ranges are specified using a hyphen \'-\'.</p>\n\n<ul>\n<li>Days are specified using the following two-letter combinations: <code>Mo</code>, <code>Tu</code>, <code>We</code>, <code>Th</code>, <code>Fr</code>, <code>Sa</code>, <code>Su</code>.</li>\n<li>Times are specified using 24:00 time. For example, 3pm is specified as <code>15:00</code>. </li>\n<li>Here is an example: <code>&lt;time itemprop=\"openingHours\" datetime=&quot;Tu,Th 16:00-20:00&quot;&gt;Tuesdays and Thursdays 4-8pm&lt;/time&gt;</code>.</li>\n<li>If a business is open 7 days a week, then it can be specified as <code>&lt;time itemprop=&quot;openingHours&quot; datetime=&quot;Mo-Su&quot;&gt;Monday through Sunday, all day&lt;/time&gt;</code>.</li>\n</ul>\n', '', '', '', 'http://schema.org/CivicStructure, http://schema.org/LocalBusiness', 'http://schema.org/Text', '', '', ''),
('http://schema.org/openingHoursSpecification', 'openingHoursSpecification', 'The opening hours of a certain place.', '', '', '', 'http://schema.org/Place', 'http://schema.org/OpeningHoursSpecification', '', '', ''),
('http://schema.org/opens', 'opens', 'The opening hour of the place or service on the given day(s) of the week.', '', '', '', 'http://schema.org/OpeningHoursSpecification', 'http://schema.org/Time', '', '', ''),
('http://schema.org/operatingSystem', 'operatingSystem', 'Operating systems supported (Windows 7, OSX 10.6, Android 1.6).', '', '', '', 'http://schema.org/SoftwareApplication', 'http://schema.org/Text', '', '', ''),
('http://schema.org/opponent', 'opponent', 'A sub property of participant. The opponent on this action.', 'http://schema.org/participant', '', '', 'http://schema.org/ExerciseAction', 'http://schema.org/Person', '', '', ''),
('http://schema.org/option', 'option', 'A sub property of object. The options subject to this action.', 'http://schema.org/object', '', '', 'http://schema.org/ChooseAction', 'http://schema.org/Text, http://schema.org/Thing', '', '', 'http://schema.org/actionOption'),
('http://schema.org/orderDate', 'orderDate', 'Date order was placed.', '', '', '', 'http://schema.org/Order', 'http://schema.org/DateTime', '', '', ''),
('http://schema.org/orderDelivery', 'orderDelivery', 'The delivery of the parcel related to this order or order item.', '', '', '', 'http://schema.org/Order, http://schema.org/OrderItem', 'http://schema.org/ParcelDelivery', '', '', ''),
('http://schema.org/orderItemNumber', 'orderItemNumber', 'The identifier of the order item.', '', '', '', 'http://schema.org/OrderItem', 'http://schema.org/Text', '', '', ''),
('http://schema.org/orderItemStatus', 'orderItemStatus', 'The current status of the order item.', '', '', '', 'http://schema.org/OrderItem', 'http://schema.org/OrderStatus', '', '', ''),
