('http://schema.org/review', 'review', 'A review of the item.', '', '', '', 'http://schema.org/Brand, http://schema.org/CreativeWork, http://schema.org/Event, http://schema.org/Offer, http://schema.org/Organization, http://schema.org/Place, http://schema.org/Product, http://schema.org/Service', 'http://schema.org/Review', '', 'http://schema.org/reviews', ''),
