('http://schema.org/reviewRating', 'reviewRating', 'The rating given in this review. Note that reviews can themselves be rated. The <code>reviewRating</code> applies to rating given by the review. The <a class=\"localLink\" href=\"http://schema.org/aggregateRating\">aggregateRating</a> property applies to the review itself, as a creative work.', '', '', '', 'http://schema.org/Review', 'http://schema.org/Rating', '', '', ''),
('http://schema.org/reviewedBy', 'reviewedBy', 'People or organizations that have reviewed the content on this web page for accuracy and/or completeness.', '', '', '', 'http://schema.org/WebPage', 'http://schema.org/Organization, http://schema.org/Person', '', '', ''),
('http://schema.org/reviews', 'reviews', 'Review of the item.', '', '', '', 'http://schema.org/CreativeWork, http://schema.org/Offer, http://schema.org/Organization, http://schema.org/Place, http://schema.org/Product', 'http://schema.org/Review', '', '', 'http://schema.org/review'),
('http://schema.org/riskFactor', 'riskFactor', 'A modifiable or non-modifiable factor that increases the risk of a patient contracting this condition, e.g. age,  coexisting condition.', '', '', '', 'http://schema.org/MedicalCondition', 'http://schema.org/MedicalRiskFactor', '', '', ''),
('http://schema.org/risks', 'risks', 'Specific physiologic risks associated to the diet plan.', '', '', '', 'http://schema.org/Diet', 'http://schema.org/Text', '', '', ''),
('http://schema.org/roleName', 'roleName', 'A role played, performed or filled by a person or organization. For example, the team of creators for a comic book might fill the roles named \'inker\', \'penciller\', and \'letterer\'; or an athlete in a SportsTeam might play in the position named \'Quarterback\'.', '', '', '', 'http://schema.org/Role', 'http://schema.org/Text, http://schema.org/URL', '', 'http://schema.org/namedPosition', ''),
('http://schema.org/roofLoad', 'roofLoad', '<p>The permitted total weight of cargo and installations (e.g. a roof rack) on top of the vehicle.</p>\n\n<p>Typical unit code(s): KGM for kilogram, LBR for pound</p>\n\n<ul>\n<li>Note 1: You can indicate additional information in the <a class=\"localLink\" href=\"http://schema.org/name\">name</a> of the <a class=\"localLink\" href=\"http://schema.org/QuantitativeValue\">QuantitativeValue</a> node.</li>\n<li>Note 2: You may also link to a <a class=\"localLink\" href=\"http://schema.org/QualitativeValue\">QualitativeValue</a> node that provides additional information using <a class=\"localLink\" href=\"http://schema.org/valueReference\">valueReference</a></li>\n<li>Note 3: Note that you can use <a class=\"localLink\" href=\"http://schema.org/minValue\">minValue</a> and <a class=\"localLink\" href=\"http://schema.org/maxValue\">maxValue</a> to indicate ranges.</li>\n</ul>\n', '', '', '', 'http://schema.org/BusOrCoach, http://schema.org/Car', 'http://schema.org/QuantitativeValue', '', '', ''),
('http://schema.org/rsvpResponse', 'rsvpResponse', 'The response (yes, no, maybe) to the RSVP.', '', '', '', 'http://schema.org/RsvpAction', 'http://schema.org/RsvpResponseType', '', '', ''),
