('http://schema.org/runtimePlatform', 'runtimePlatform', 'Runtime platform or script interpreter dependencies (Example - Java v1, Python2.3, .Net Framework 3.0).', '', '', '', 'http://schema.org/SoftwareSourceCode', 'http://schema.org/Text', '', 'http://schema.org/runtime', ''),
