('http://schema.org/salaryCurrency', 'salaryCurrency', 'The currency (coded using <a href=\"http://en.wikipedia.org/wiki/ISO_4217\">ISO 4217</a> ) used for the main salary information in this job posting or for this employee.', '', '', '', 'http://schema.org/EmployeeRole, http://schema.org/JobPosting', 'http://schema.org/Text', '', '', ''),
