('http://schema.org/telephone', 'telephone', 'The telephone number.', '', '', '', 'http://schema.org/ContactPoint, http://schema.org/Organization, http://schema.org/Person, http://schema.org/Place', 'http://schema.org/Text', '', '', ''),
('http://schema.org/temporal', 'temporal', 'The range of temporal applicability of a dataset, e.g. for a 2011 census dataset, the year 2011 (in ISO 8601 time interval format).', '', '', '', 'http://schema.org/Dataset', 'http://schema.org/DateTime', '', '', 'http://schema.org/temporalCoverage'),
('http://schema.org/temporalCoverage', 'temporalCoverage', 'The temporalCoverage of a CreativeWork indicates the period that the content applies to, i.e. that it describes, either as a DateTime or as a textual string indicating a time period in <a href=\"https://en.wikipedia.org/wiki/ISO_8601#Time_intervals\">ISO 8601 time interval format</a>. In\n      the case of a Dataset it will typically indicate the relevant time period in a precise notation (e.g. for a 2011 census dataset, the year 2011 would be written \"2011/2012\"). Other forms of content e.g. ScholarlyArticle, Book, TVSeries or TVEpisode may indicate their temporalCoverage in broader terms - textually or via well-known URL.\n      Written works such as books may sometimes have precise temporal coverage too, e.g. a work set in 1939 - 1945 can be indicated in ISO 8601 interval format format via \"1939/1945\".', '', 'http://purl.org/dc/terms/temporal', '', 'http://schema.org/CreativeWork', 'http://schema.org/DateTime, http://schema.org/Text, http://schema.org/URL', '', 'http://schema.org/datasetTimeInterval, http://schema.org/temporal', ''),
('http://schema.org/termsOfService', 'termsOfService', 'Human-readable terms of service documentation.', '', '', '', 'http://schema.org/Service', 'http://schema.org/Text, http://schema.org/URL', '', '', ''),
('http://schema.org/text', 'text', 'The textual content of this CreativeWork.', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/Text', '', '', ''),
('http://schema.org/thumbnail', 'thumbnail', 'Thumbnail image for an image or video.', '', '', '', 'http://schema.org/ImageObject, http://schema.org/VideoObject', 'http://schema.org/ImageObject', '', '', ''),
('http://schema.org/thumbnailUrl', 'thumbnailUrl', 'A thumbnail image relevant to the Thing.', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/URL', '', '', ''),
('http://schema.org/tickerSymbol', 'tickerSymbol', 'The exchange traded instrument associated with a Corporation object. The tickerSymbol is expressed as an exchange and an instrument name separated by a space character. For the exchange component of the tickerSymbol attribute, we reccommend using the controlled vocaulary of Market Identifier Codes (MIC) specified in ISO15022.', '', '', '', 'http://schema.org/Corporation', 'http://schema.org/Text', '', '', ''),
('http://schema.org/ticketNumber', 'ticketNumber', 'The unique identifier for the ticket.', '', '', '', 'http://schema.org/Ticket', 'http://schema.org/Text', '', '', ''),
('http://schema.org/ticketToken', 'ticketToken', 'Reference to an asset (e.g., Barcode, QR code image or PDF) usable for entrance.', '', '', '', 'http://schema.org/Ticket', 'http://schema.org/Text, http://schema.org/URL', '', '', ''),
('http://schema.org/ticketedSeat', 'ticketedSeat', 'The seat associated with the ticket.', '', '', '', 'http://schema.org/Ticket', 'http://schema.org/Seat', '', '', ''),
('http://schema.org/timeRequired', 'timeRequired', 'Approximate or typical time it takes to work with or through this learning resource for the typical intended target audience, e.g. \'P30M\', \'P1H25M\'.', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/Duration', '', '', ''),
('http://schema.org/tissueSample', 'tissueSample', 'The type of tissue sample required for the test.', '', '', '', 'http://schema.org/PathologyTest', 'http://schema.org/Text', '', '', ''),
('http://schema.org/title', 'title', 'The title of the job.', '', '', '', 'http://schema.org/JobPosting', 'http://schema.org/Text', '', '', ''),
('http://schema.org/toLocation', 'toLocation', 'A sub property of location. The final location of the object or the agent after the action.', 'http://schema.org/location', '', '', 'http://schema.org/ExerciseAction, http://schema.org/InsertAction, http://schema.org/MoveAction, http://schema.org/TransferAction', 'http://schema.org/Place', '', '', ''),
('http://schema.org/tongueWeight', 'tongueWeight', '<p>The permitted vertical load (TWR) of a trailer attached to the vehicle. Also referred to as Tongue Load Rating (TLR) or Vertical Load Rating (VLR)</p>\n\n<p>Typical unit code(s): KGM for kilogram, LBR for pound</p>\n\n<ul>\n<li>Note 1: You can indicate additional information in the <a class=\"localLink\" href=\"http://schema.org/name\">name</a> of the <a class=\"localLink\" href=\"http://schema.org/QuantitativeValue\">QuantitativeValue</a> node.</li>\n<li>Note 2: You may also link to a <a class=\"localLink\" href=\"http://schema.org/QualitativeValue\">QualitativeValue</a> node that provides additional information using <a class=\"localLink\" href=\"http://schema.org/valueReference\">valueReference</a>.</li>\n<li>Note 3: Note that you can use <a class=\"localLink\" href=\"http://schema.org/minValue\">minValue</a> and <a class=\"localLink\" href=\"http://schema.org/maxValue\">maxValue</a> to indicate ranges.</li>\n</ul>\n', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/QuantitativeValue', '', '', ''),
('http://schema.org/torque', 'torque', '<p>The torque (turning force) of the vehicle\'s engine.</p>\n\n<p>Typical unit code(s): NU for newton metre (N m), F17 for pound-force per foot, or F48 for pound-force per inch</p>\n\n<ul>\n<li>Note 1: You can link to information about how the given value has been determined (e.g. reference RPM) using the <a class=\"localLink\" href=\"http://schema.org/valueReference\">valueReference</a> property.</li>\n<li>Note 2: You can use <a class=\"localLink\" href=\"http://schema.org/minValue\">minValue</a> and <a class=\"localLink\" href=\"http://schema.org/maxValue\">maxValue</a> to indicate ranges.</li>\n</ul>\n', '', '', '', 'http://schema.org/EngineSpecification', 'http://schema.org/QuantitativeValue', '', '', ''),
('http://schema.org/totalPaymentDue', 'totalPaymentDue', 'The total amount due.', '', '', '', 'http://schema.org/Invoice', 'http://schema.org/MonetaryAmount, http://schema.org/PriceSpecification', '', '', ''),
('http://schema.org/totalPrice', 'totalPrice', 'The total price for the reservation or ticket, including applicable taxes, shipping, etc.', '', '', '', 'http://schema.org/Reservation, http://schema.org/Ticket', 'http://schema.org/Number, http://schema.org/PriceSpecification, http://schema.org/Text', '', '', ''),
('http://schema.org/totalTime', 'totalTime', 'The total time it takes to prepare and cook the recipe, in <a href=\"http://en.wikipedia.org/wiki/ISO_8601\">ISO 8601 duration format</a>.', '', '', '', 'http://schema.org/Recipe', 'http://schema.org/Duration', '', '', ''),
('http://schema.org/track', 'track', 'A music recording (track)&#x2014;usually a single song. If an ItemList is given, the list should contain items of type MusicRecording.', '', '', '', 'http://schema.org/MusicGroup, http://schema.org/MusicPlaylist', 'http://schema.org/ItemList, http://schema.org/MusicRecording', '', 'http://schema.org/tracks', ''),
('http://schema.org/trackingNumber', 'trackingNumber', 'Shipper tracking number.', '', '', '', 'http://schema.org/ParcelDelivery', 'http://schema.org/Text', '', '', ''),
