('http://schema.org/tracks', 'tracks', 'A music recording (track)&#x2014;usually a single song.', '', '', '', 'http://schema.org/MusicGroup, http://schema.org/MusicPlaylist', 'http://schema.org/MusicRecording', '', '', 'http://schema.org/track'),
('http://schema.org/trailer', 'trailer', 'The trailer of a movie or tv/radio series, season, episode, etc.', '', '', '', 'http://schema.org/CreativeWorkSeason, http://schema.org/Episode, http://schema.org/Movie, http://schema.org/MovieSeries, http://schema.org/RadioSeries, http://schema.org/TVSeries, http://schema.org/VideoGame, http://schema.org/VideoGameSeries', 'http://schema.org/VideoObject', '', '', ''),
('http://schema.org/trailerWeight', 'trailerWeight', 'The permitted weight of a trailer attached to the vehicle.</p>\n\n<p>Typical unit code(s): KGM for kilogram, LBR for pound\n* Note 1: You can indicate additional information in the <a class=\"localLink\" href=\"http://schema.org/name\">name</a> of the <a class=\"localLink\" href=\"http://schema.org/QuantitativeValue\">QuantitativeValue</a> node.\n* Note 2: You may also link to a <a class=\"localLink\" href=\"http://schema.org/QualitativeValue\">QualitativeValue</a> node that provides additional information using <a class=\"localLink\" href=\"http://schema.org/valueReference\">valueReference</a>.\n* Note 3: Note that you can use <a class=\"localLink\" href=\"http://schema.org/minValue\">minValue</a> and <a class=\"localLink\" href=\"http://schema.org/maxValue\">maxValue</a> to indicate ranges.', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/QuantitativeValue', '', '', ''),
('http://schema.org/trainName', 'trainName', 'The name of the train (e.g. The Orient Express).', '', '', '', 'http://schema.org/TrainTrip', 'http://schema.org/Text', '', '', ''),
