('http://schema.org/transFatContent', 'transFatContent', 'The number of grams of trans fat.', '', '', '', 'http://schema.org/NutritionInformation', 'http://schema.org/Mass', '', '', ''),
('http://schema.org/transcript', 'transcript', 'If this MediaObject is an AudioObject or VideoObject, the transcript of that object.', '', '', '', 'http://schema.org/AudioObject, http://schema.org/VideoObject', 'http://schema.org/Text', '', '', ''),
('http://schema.org/translationOfWork', 'translationOfWork', 'The work that this work has been translated from. e.g. ???? is a translationOf “On the Origin of Species”', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/CreativeWork', 'http://schema.org/workTranslation', '', ''),
('http://schema.org/translator', 'translator', 'Organization or person who adapts a creative work to different languages, regional differences and technical requirements of a target market, or that translates during some event.', '', '', '', 'http://schema.org/CreativeWork, http://schema.org/Event', 'http://schema.org/Organization, http://schema.org/Person', '', '', ''),
('http://schema.org/transmissionMethod', 'transmissionMethod', 'How the disease spreads, either as a route or vector, for example \'direct contact\', \'Aedes aegypti\', etc.', '', '', '', 'http://schema.org/InfectiousDisease', 'http://schema.org/Text', '', '', ''),
('http://schema.org/trialDesign', 'trialDesign', 'Specifics about the trial design (enumerated).', '', '', '', 'http://schema.org/MedicalTrial', 'http://schema.org/MedicalTrialDesign', '', '', ''),
('http://schema.org/tributary', 'tributary', 'The anatomical or organ system that the vein flows into; a larger structure that the vein connects to.', '', '', '', 'http://schema.org/Vein', 'http://schema.org/AnatomicalStructure', '', '', ''),
('http://schema.org/typeOfBed', 'typeOfBed', 'The type of bed to which the BedDetail refers, i.e. the type of bed available in the quantity indicated by quantity.', '', '', '', 'http://schema.org/BedDetails', 'http://schema.org/BedType, http://schema.org/Text', '', '', '');
