('http://schema.org/value', 'value', '<p>The value of the quantitative value or property value node.</p>\n\n<ul>\n<li>For <a class=\"localLink\" href=\"http://schema.org/QuantitativeValue\">QuantitativeValue</a> and <a class=\"localLink\" href=\"http://schema.org/MonetaryAmount\">MonetaryAmount</a>, the recommended type for values is \'Number\'.</li>\n<li>For <a class=\"localLink\" href=\"http://schema.org/PropertyValue\">PropertyValue</a>, it can be \'Text;\', \'Number\', \'Boolean\', or \'StructuredValue\'.</li>\n</ul>\n', '', '', '', 'http://schema.org/MonetaryAmount, http://schema.org/PropertyValue, http://schema.org/QuantitativeValue', 'http://schema.org/Boolean, http://schema.org/Number, http://schema.org/StructuredValue, http://schema.org/Text', '', '', ''),
('http://schema.org/valueAddedTaxIncluded', 'valueAddedTaxIncluded', 'Specifies whether the applicable value-added tax (VAT) is included in the price specification or not.', '', '', '', 'http://schema.org/PriceSpecification', 'http://schema.org/Boolean', '', '', ''),
('http://schema.org/valueMaxLength', 'valueMaxLength', 'Specifies the allowed range for number of characters in a literal value.', '', '', '', 'http://schema.org/PropertyValueSpecification', 'http://schema.org/Number', '', '', ''),
('http://schema.org/valueMinLength', 'valueMinLength', 'Specifies the minimum allowed range for number of characters in a literal value.', '', '', '', 'http://schema.org/PropertyValueSpecification', 'http://schema.org/Number', '', '', ''),
('http://schema.org/valueName', 'valueName', 'Indicates the name of the PropertyValueSpecification to be used in URL templates and form encoding in a manner analogous to HTML\'s input@name.', '', '', '', 'http://schema.org/PropertyValueSpecification', 'http://schema.org/Text', '', '', ''),
('http://schema.org/valuePattern', 'valuePattern', 'Specifies a regular expression for testing literal values according to the HTML spec.', '', '', '', 'http://schema.org/PropertyValueSpecification', 'http://schema.org/Text', '', '', ''),
('http://schema.org/valueReference', 'valueReference', 'A pointer to a secondary value that provides additional information on the original value, e.g. a reference temperature.', '', '', '', 'http://schema.org/PropertyValue, http://schema.org/QualitativeValue, http://schema.org/QuantitativeValue', 'http://schema.org/Enumeration, http://schema.org/PropertyValue, http://schema.org/QualitativeValue, http://schema.org/QuantitativeValue, http://schema.org/StructuredValue', '', '', ''),
('http://schema.org/valueRequired', 'valueRequired', 'Whether the property must be filled in to complete the action.  Default is false.', '', '', '', 'http://schema.org/PropertyValueSpecification', 'http://schema.org/Boolean', '', '', ''),
('http://schema.org/variableMeasured', 'variableMeasured', 'The variableMeasured property can indicate (repeated as necessary) the  variables that are measured in some dataset, either described as text or as pairs of identifier and description using PropertyValue.', '', '', '', 'http://schema.org/Dataset', 'http://schema.org/PropertyValue, http://schema.org/Text', '', '', ''),
('http://schema.org/variantCover', 'variantCover', 'A description of the variant cover\n    for the issue, if the issue is a variant printing. For example, \"Bryan Hitch\n    Variant Cover\" or \"2nd Printing Variant\".', '', '', '', 'http://schema.org/ComicIssue', 'http://schema.org/Text', '', '', ''),
('http://schema.org/vatID', 'vatID', 'The Value-added Tax ID of the organization or person.', '', '', '', 'http://schema.org/Organization, http://schema.org/Person', 'http://schema.org/Text', '', '', ''),
('http://schema.org/vehicleConfiguration', 'vehicleConfiguration', 'A short text indicating the configuration of the vehicle, e.g. \'5dr hatchback ST 2.5 MT 225 hp\' or \'limited edition\'.', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/Text', '', '', ''),
('http://schema.org/vehicleEngine', 'vehicleEngine', 'Information about the engine or engines of the vehicle.', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/EngineSpecification', '', '', ''),
('http://schema.org/vehicleIdentificationNumber', 'vehicleIdentificationNumber', 'The Vehicle Identification Number (VIN) is a unique serial number used by the automotive industry to identify individual motor vehicles.', 'http://schema.org/serialNumber', '', '', 'http://schema.org/Vehicle', 'http://schema.org/Text', '', '', ''),
('http://schema.org/vehicleInteriorColor', 'vehicleInteriorColor', 'The color or color combination of the interior of the vehicle.', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/Text', '', '', ''),
('http://schema.org/vehicleInteriorType', 'vehicleInteriorType', 'The type or material of the interior of the vehicle (e.g. synthetic fabric, leather, wood, etc.). While most interior types are characterized by the material used, an interior type can also be based on vehicle usage or target audience.', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/Text', '', '', ''),
('http://schema.org/vehicleModelDate', 'vehicleModelDate', 'The release date of a vehicle model (often used to differentiate versions of the same make and model).', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/Date', '', '', ''),
('http://schema.org/vehicleSeatingCapacity', 'vehicleSeatingCapacity', 'The number of passengers that can be seated in the vehicle, both in terms of the physical space available, and in terms of limitations set by law.</p>\n\n<p>Typical unit code(s): C62 for persons.', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/Number, http://schema.org/QuantitativeValue', '', '', ''),
('http://schema.org/vehicleSpecialUsage', 'vehicleSpecialUsage', 'Indicates whether the vehicle has been used for special purposes, like commercial rental, driving school, or as a taxi. The legislation in many countries requires this information to be revealed when offering a car for sale.', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/CarUsageType, http://schema.org/Text', '', '', ''),
('http://schema.org/vehicleTransmission', 'vehicleTransmission', 'The type of component used for transmitting the power from a rotating power source to the wheels or other relevant component(s) (\"gearbox\" for cars).', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/QualitativeValue, http://schema.org/Text, http://schema.org/URL', '', '', ''),
