('http://schema.org/warning', 'warning', 'Any FDA or other warnings about the drug (text or URL).', '', '', '', 'http://schema.org/Drug', 'http://schema.org/Text, http://schema.org/URL', '', '', ''),
('http://schema.org/warranty', 'warranty', 'The warranty promise(s) included in the offer.', '', '', '', 'http://schema.org/Demand, http://schema.org/Offer', 'http://schema.org/WarrantyPromise', '', 'http://schema.org/warrantyPromise', ''),
('http://schema.org/warrantyPromise', 'warrantyPromise', 'The warranty promise(s) included in the offer.', '', '', '', 'http://schema.org/BuyAction, http://schema.org/SellAction', 'http://schema.org/WarrantyPromise', '', '', 'http://schema.org/warranty'),
('http://schema.org/warrantyScope', 'warrantyScope', 'The scope of the warranty promise.', '', '', '', 'http://schema.org/WarrantyPromise', 'http://schema.org/WarrantyScope', '', '', ''),
('http://schema.org/webCheckinTime', 'webCheckinTime', 'The time when a passenger can check into the flight online.', '', '', '', 'http://schema.org/Flight', 'http://schema.org/DateTime', '', '', ''),
('http://schema.org/weight', 'weight', 'The weight of the product or person.', '', '', '', 'http://schema.org/Person, http://schema.org/Product', 'http://schema.org/QuantitativeValue', '', '', ''),
('http://schema.org/weightTotal', 'weightTotal', '<p>The permitted total weight of the loaded vehicle, including passengers and cargo and the weight of the empty vehicle.</p>\n\n<p>Typical unit code(s): KGM for kilogram, LBR for pound</p>\n\n<ul>\n<li>Note 1: You can indicate additional information in the <a class=\"localLink\" href=\"http://schema.org/name\">name</a> of the <a class=\"localLink\" href=\"http://schema.org/QuantitativeValue\">QuantitativeValue</a> node.</li>\n<li>Note 2: You may also link to a <a class=\"localLink\" href=\"http://schema.org/QualitativeValue\">QualitativeValue</a> node that provides additional information using <a class=\"localLink\" href=\"http://schema.org/valueReference\">valueReference</a>.</li>\n<li>Note 3: Note that you can use <a class=\"localLink\" href=\"http://schema.org/minValue\">minValue</a> and <a class=\"localLink\" href=\"http://schema.org/maxValue\">maxValue</a> to indicate ranges.</li>\n</ul>\n', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/QuantitativeValue', '', '', ''),
('http://schema.org/wheelbase', 'wheelbase', 'The distance between the centers of the front and rear wheels.</p>\n\n<p>Typical unit code(s): CMT for centimeters, MTR for meters, INH for inches, FOT for foot/feet', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/QuantitativeValue', '', '', ''),
('http://schema.org/width', 'width', 'The width of the item.', '', '', '', 'http://schema.org/MediaObject, http://schema.org/Product, http://schema.org/VisualArtwork', 'http://schema.org/Distance, http://schema.org/QuantitativeValue', '', '', ''),
('http://schema.org/winner', 'winner', 'A sub property of participant. The winner of the action.', 'http://schema.org/participant', '', '', 'http://schema.org/LoseAction', 'http://schema.org/Person', '', '', ''),
('http://schema.org/wordCount', 'wordCount', 'The number of words in the text of the Article.', '', '', '', 'http://schema.org/Article', 'http://schema.org/Integer', '', '', ''),
('http://schema.org/workExample', 'workExample', 'Example/instance/realization/derivation of the concept of this creative work. eg. The paperback edition, first edition, or eBook.', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/CreativeWork', 'http://schema.org/exampleOfWork', '', ''),
('http://schema.org/workFeatured', 'workFeatured', 'A work featured in some event, e.g. exhibited in an ExhibitionEvent.\n       Specific subproperties are available for workPerformed (e.g. a play), or a workPresented (a Movie at a ScreeningEvent).', '', '', 'http://schema.org/workPerformed, http://schema.org/workPresented', 'http://schema.org/Event', 'http://schema.org/CreativeWork', '', '', ''),
('http://schema.org/workHours', 'workHours', 'The typical working hours for this job (e.g. 1st shift, night shift, 8am-5pm).', '', '', '', 'http://schema.org/JobPosting', 'http://schema.org/Text', '', '', ''),
('http://schema.org/workLocation', 'workLocation', 'A contact location for a person\'s place of work.', 'http://schema.org/location', '', '', 'http://schema.org/Person', 'http://schema.org/ContactPoint, http://schema.org/Place', '', '', ''),
('http://schema.org/workPerformed', 'workPerformed', 'A work performed in some event, for example a play performed in a TheaterEvent.', 'http://schema.org/workFeatured', '', '', 'http://schema.org/Event', 'http://schema.org/CreativeWork', '', '', ''),
('http://schema.org/workPresented', 'workPresented', 'The movie presented during this event.', 'http://schema.org/workFeatured', '', '', 'http://schema.org/ScreeningEvent', 'http://schema.org/Movie', '', '', ''),
('http://schema.org/workTranslation', 'workTranslation', 'A work that is a translation of the content of this work. e.g. ??? has an English workTranslation “Journey to the West”,a German workTranslation “Monkeys Pilgerfahrt” and a Vietnamese  translation Tây du ký bình kh?o.', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/CreativeWork', 'http://schema.org/translationOfWork', '', ''),
('http://schema.org/workload', 'workload', 'Quantitative measure of the physiologic output of the exercise; also referred to as energy expenditure.', '', '', '', 'http://schema.org/ExercisePlan', 'http://schema.org/Energy, http://schema.org/QualitativeValue', '', '', ''),
('http://schema.org/worksFor', 'worksFor', 'Organizations that the person works for.', '', '', '', 'http://schema.org/Person', 'http://schema.org/Organization', '', '', ''),
('http://schema.org/worstRating', 'worstRating', 'The lowest value allowed in this rating system. If worstRating is omitted, 1 is assumed.', '', '', '', 'http://schema.org/Rating', 'http://schema.org/Number, http://schema.org/Text', '', '', ''),
('http://schema.org/xpath', 'xpath', 'An XPath.', '', '', '', 'http://schema.org/SpeakableSpecification', 'http://schema.org/Text', '', '', ''),
('http://schema.org/yearlyRevenue', 'yearlyRevenue', 'The size of the business in annual revenue.', '', '', '', 'http://schema.org/BusinessAudience', 'http://schema.org/QuantitativeValue', '', '', ''),
('http://schema.org/yearsInOperation', 'yearsInOperation', 'The age of the business.', '', '', '', 'http://schema.org/BusinessAudience', 'http://schema.org/QuantitativeValue', '', '', '');
INSERT INTO `properties2` (`n`, `id`, `label`, `etiqueta`, `comment`, `subPropertyOf`, `equivalentProperty`, `subproperties`, `domainIncludes`, `rangeIncludes`, `inversOf`, `supersedes`, `supersededBy`) VALUES
(1, 'http://schema.org/about', 'about', 'acerca de', 'The subject matter of the content.', '', '', '', 'http://schema.org/CommunicateAction, http://schema.org/CreativeWork, http://schema.org/Event', 'http://schema.org/Thing', '', '', ''),
(2, 'http://schema.org/abridged', 'abridged', 'reducido', 'Indicates whether the book is an abridged edition.', '', '', '', 'http://schema.org/Book', 'http://schema.org/Boolean', '', '', ''),
(3, 'http://schema.org/accelerationTime', 'accelerationTime', 'tiempo de aceleraciÃ³n', '<p>The time needed to accelerate the vehicle from a given start velocity to a given target velocity.</p>\n\n<p>Typical unit code(s): SEC for seconds</p>\n\n<ul>\n<li>Note: There are unfortunately no standard unit codes for seconds/0..100 km/h or seconds/0..60 mph. Simply use \"SEC\" for seconds and indicate the velocities in the <a class=\"localLink\" href=\"http://schema.org/name\">name</a> of the <a class=\"localLink\" href=\"http://schema.org/QuantitativeValue\">QuantitativeValue</a>, or use <a class=\"localLink\" href=\"http://schema.org/valueReference\">valueReference</a> with a <a class=\"localLink\" href=\"http://schema.org/QuantitativeValue\">QuantitativeValue</a> of 0..60 mph or 0..100 km/h to specify the reference speeds.</li>\n</ul>\n', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/QuantitativeValue', '', '', ''),
(4, 'http://schema.org/acceptedAnswer', 'acceptedAnswer', 'Aceptado', 'The answer that has been accepted as best, typically on a Question/Answer site. Sites vary in their selection mechanisms, e.g. drawing on community opinion and/or the view of the Question author.', 'http://schema.org/suggestedAnswer', '', '', 'http://schema.org/Question', 'http://schema.org/Answer', '', '', ''),
(5, 'http://schema.org/acceptedOffer', 'acceptedOffer', 'AceptÃ³ oferta', 'The offer(s) -- e.g., product, quantity and price combinations -- included in the order.', '', '', '', 'http://schema.org/Order', 'http://schema.org/Offer', '', '', ''),
(6, 'http://schema.org/acceptedPaymentMethod', 'acceptedPaymentMethod', 'MÃ©todo de pago aceptado', 'The payment method(s) accepted by seller for this offer.', '', '', '', 'http://schema.org/Demand, http://schema.org/Offer', 'http://schema.org/LoanOrCredit, http://schema.org/PaymentMethod', '', '', ''),
(7, 'http://schema.org/acceptsReservations', 'acceptsReservations', 'Acepta reservas', 'Indicates whether a FoodEstablishment accepts reservations. Values can be Boolean, an URL at which reservations can be made or (for backwards compatibility) the strings <code>Yes</code> or <code>No</code>.', '', '', '', 'http://schema.org/FoodEstablishment', 'http://schema.org/Boolean, http://schema.org/Text, http://schema.org/URL', '', '', ''),
(8, 'http://schema.org/accessCode', 'accessCode', 'cÃ³digo de acceso', 'Password, PIN, or access code needed for delivery (e.g. from a locker).', '', '', '', 'http://schema.org/DeliveryEvent', 'http://schema.org/Text', '', '', ''),
(9, 'http://schema.org/accessMode', 'accessMode', 'modo de acceso', 'The human sensory perceptual system or cognitive faculty through which a person may process or perceive information. Expected values include: auditory, tactile, textual, visual, colorDependent, chartOnVisual, chemOnVisual, diagramOnVisual, mathOnVisual, musicOnVisual, textOnVisual.', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/Text', '', '', ''),
(10, 'http://schema.org/accessModeSufficient', 'accessModeSufficient', 'Modo de acceso Suficiente', 'A list of single or combined accessModes that are sufficient to understand all the intellectual content of a resource. Expected values include:  auditory, tactile, textual, visual.', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/Text', '', '', ''),
(11, 'http://schema.org/accessibilityAPI', 'accessibilityAPI', 'API de accesibilidad', 'Indicates that the resource is compatible with the referenced accessibility API (<a href=\"http://www.w3.org/wiki/WebSchemas/Accessibility\">WebSchemas wiki lists possible values</a>).', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/Text', '', '', ''),
(12, 'http://schema.org/accessibilityControl', 'accessibilityControl', 'Control de accesibilidad', 'Identifies input methods that are sufficient to fully control the described resource (<a href=\"http://www.w3.org/wiki/WebSchemas/Accessibility\">WebSchemas wiki lists possible values</a>).', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/Text', '', '', ''),
(13, 'http://schema.org/accessibilityFeature', 'accessibilityFeature', 'Accesibilidad', 'Content features of the resource, such as accessible media, alternatives and supported enhancements for accessibility (<a href=\"http://www.w3.org/wiki/WebSchemas/Accessibility\">WebSchemas wiki lists possible values</a>).', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/Text', '', '', ''),
(14, 'http://schema.org/accessibilityHazard', 'accessibilityHazard', 'Peligro de accesibilidad', 'A characteristic of the described resource that is physiologically dangerous to some users. Related to WCAG 2.0 guideline 2.3 (<a href=\"http://www.w3.org/wiki/WebSchemas/Accessibility\">WebSchemas wiki lists possible values</a>).', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/Text', '', '', ''),
(15, 'http://schema.org/accessibilitySummary', 'accessibilitySummary', 'Accesibilidad Resumen', 'A human-readable summary of specific accessibility features or deficiencies, consistent with the other accessibility metadata but expressing subtleties such as \"short descriptions are present but long descriptions will be needed for non-visual users\" or \"short descriptions are present and no long descriptions are needed.\"', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/Text', '', '', ''),
(16, 'http://schema.org/accountId', 'accountId', 'ID de la cuenta', 'The identifier for the account the payment will be applied to.', 'http://schema.org/identifier', '', '', 'http://schema.org/Invoice', 'http://schema.org/Text', '', '', ''),
(17, 'http://schema.org/accountMinimumInflow', 'accountMinimumInflow', 'Ingreso mÃ­nimo de la cuenta', 'A minimum amount that has to be paid in every month.', '', '', '', 'http://schema.org/BankAccount', 'http://schema.org/MonetaryAmount', '', '', ''),
(18, 'http://schema.org/accountOverdraftLimit', 'accountOverdraftLimit', 'LÃ­mite de sobregiro', 'An overdraft is an extension of credit from a lending institution when an account reaches zero. An overdraft allows the individual to continue withdrawing money even if the account has no funds in it. Basically the bank allows people to borrow a set amount of money.', '', '', '', 'http://schema.org/BankAccount', 'http://schema.org/MonetaryAmount', '', '', ''),
(19, 'http://schema.org/accountablePerson', 'accountablePerson', 'Persona responsable', 'Specifies the Person that is legally accountable for the CreativeWork.', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/Person', '', '', ''),
(20, 'http://schema.org/acquiredFrom', 'acquiredFrom', 'Adquirido de', 'The organization or person from which the product was acquired.', '', '', '', 'http://schema.org/OwnershipInfo', 'http://schema.org/Organization, http://schema.org/Person', '', '', ''),
(21, 'http://schema.org/acrissCode', 'acrissCode', 'CÃ³digo acril', 'The ACRISS Car Classification Code is a code used by many car rental companies, for classifying vehicles. ACRISS stands for Association of Car Rental Industry Systems and Standards.', '', '', '', 'http://schema.org/BusOrCoach, http://schema.org/Car', 'http://schema.org/Text', '', '', ''),
(22, 'http://schema.org/action', 'action', 'acciÃ³n', 'Obsolete term for <a class=\"localLink\" href=\"http://schema.org/muscleAction\">muscleAction</a>. Not to be confused with <a class=\"localLink\" href=\"http://schema.org/potentialAction\">potentialAction</a>.', '', '', '', 'http://schema.org/Muscle', 'http://schema.org/Text', '', '', ''),
(23, 'http://schema.org/actionApplication', 'actionApplication', 'AcciÃ³n AplicaciÃ³n', 'An application that can complete the request.', '', '', '', 'http://schema.org/EntryPoint', 'http://schema.org/SoftwareApplication', '', 'http://schema.org/application', ''),
(24, 'http://schema.org/actionOption', 'actionOption', 'OpciÃ³n de acciÃ³n', 'A sub property of object. The options subject to this action.', 'http://schema.org/object', '', '', 'http://schema.org/ChooseAction', 'http://schema.org/Text, http://schema.org/Thing', '', 'http://schema.org/option', ''),
(25, 'http://schema.org/actionPlatform', 'actionPlatform', 'Plataforma de acciÃ³n', 'The high level platform(s) where the Action can be performed for the given URL. To specify a specific application or operating system instance, use actionApplication.', '', '', '', 'http://schema.org/EntryPoint', 'http://schema.org/Text, http://schema.org/URL', '', '', ''),
(26, 'http://schema.org/actionStatus', 'actionStatus', 'AcciÃ³n Estado', 'Indicates the current disposition of the Action.', '', '', '', 'http://schema.org/Action', 'http://schema.org/ActionStatusType', '', '', ''),
(27, 'http://schema.org/activeIngredient', 'activeIngredient', 'ingrediente activo', 'An active ingredient, typically chemical compounds and/or biologic substances.', '', '', '', 'http://schema.org/DietarySupplement, http://schema.org/Drug, http://schema.org/DrugStrength, http://schema.org/Substance', 'http://schema.org/Text', '', '', ''),
(28, 'http://schema.org/activityDuration', 'activityDuration', 'Actividad DuraciÃ³n', 'Length of time to engage in the activity.', '', '', '', 'http://schema.org/ExercisePlan', 'http://schema.org/Duration, http://schema.org/QualitativeValue', '', '', ''),
(29, 'http://schema.org/activityFrequency', 'activityFrequency', 'Actividad Frecuencia', 'How often one should engage in the activity.', '', '', '', 'http://schema.org/ExercisePlan', 'http://schema.org/QualitativeValue, http://schema.org/Text', '', '', ''),
(30, 'http://schema.org/actor', 'actor', 'actor', 'An actor, e.g. in tv, radio, movie, video games etc., or in an event. Actors can be associated with individual items or with a series, episode, clip.', '', '', 'http://schema.org/readBy', 'http://schema.org/Clip, http://schema.org/CreativeWorkSeason, http://schema.org/Episode, http://schema.org/Event, http://schema.org/Movie, http://schema.org/MovieSeries, http://schema.org/RadioSeries, http://schema.org/TVSeries, http://schema.org/VideoGame, http://schema.org/VideoGameSeries, http://schema.org/VideoObject', 'http://schema.org/Person', '', 'http://schema.org/actors', ''),
(31, 'http://schema.org/actors', 'actors', 'Actores', 'An actor, e.g. in tv, radio, movie, video games etc. Actors can be associated with individual items or with a series, episode, clip.', '', '', '', 'http://schema.org/Clip, http://schema.org/Episode, http://schema.org/Movie, http://schema.org/MovieSeries, http://schema.org/RadioSeries, http://schema.org/TVSeries, http://schema.org/VideoGame, http://schema.org/VideoGameSeries, http://schema.org/VideoObject', 'http://schema.org/Person', '', '', 'http://schema.org/actor'),
(32, 'http://schema.org/addOn', 'addOn', 'AÃ±adir', 'An additional offer that can only be obtained in combination with the first base offer (e.g. supplements and extensions that are available for a surcharge).', '', '', '', 'http://schema.org/Offer', 'http://schema.org/Offer', '', '', ''),
(33, 'http://schema.org/additionalName', 'additionalName', 'nombre adicional', 'An additional name for a Person, can be used for a middle name.', '', '', '', 'http://schema.org/Person', 'http://schema.org/Text', '', '', ''),
(34, 'http://schema.org/additionalNumberOfGuests', 'additionalNumberOfGuests', 'NÃºmero adicional de huÃ©spedes', 'If responding yes, the number of guests who will attend in addition to the invitee.', '', '', '', 'http://schema.org/RsvpAction', 'http://schema.org/Number', '', '', ''),
(35, 'http://schema.org/additionalProperty', 'additionalProperty', 'Propiedad adicional', 'A property-value pair representing an additional characteristics of the entitity, e.g. a product feature or another characteristic for which there is no matching property in schema.org.</p>\n\n<p>Note: Publishers should be aware that applications designed to use specific schema.org properties (e.g. http://schema.org/width, http://schema.org/color, http://schema.org/gtin13, ...) will typically expect such data to be provided using those properties, rather than using the generic property/value mechanism.', '', '', '', 'http://schema.org/Place, http://schema.org/Product, http://schema.org/QualitativeValue, http://schema.org/QuantitativeValue', 'http://schema.org/PropertyValue', '', '', ''),
(36, 'http://schema.org/additionalType', 'additionalType', 'Tipo adicional', 'An additional type for the item, typically used for adding more specific types from external vocabularies in microdata syntax. This is a relationship between something and a class that the thing is in. In RDFa syntax, it is better to use the native RDFa syntax - the \'typeof\' attribute - for multiple types. Schema.org tools may have only weaker understanding of extra types, in particular those defined externally.', '', '', '', 'http://schema.org/Thing', 'http://schema.org/URL', '', '', ''),
(37, 'http://schema.org/additionalVariable', 'additionalVariable', 'Variable adicional', 'Any additional component of the exercise prescription that may need to be articulated to the patient. This may include the order of exercises, the number of repetitions of movement, quantitative distance, progressions over time, etc.', '', '', '', 'http://schema.org/ExercisePlan', 'http://schema.org/Text', '', '', ''),
(38, 'http://schema.org/address', 'address', 'direcciÃ³n', 'Physical address of the item.', '', '', '', 'http://schema.org/GeoCoordinates, http://schema.org/GeoShape, http://schema.org/Organization, http://schema.org/Person, http://schema.org/Place', 'http://schema.org/PostalAddress, http://schema.org/Text', '', '', ''),
(39, 'http://schema.org/addressCountry', 'addressCountry', 'DirecciÃ³n PaÃ­s', 'The country. For example, USA. You can also provide the two-letter <a href=\"http://en.wikipedia.org/wiki/ISO_3166-1\">ISO 3166-1 alpha-2 country code</a>.', '', '', '', 'http://schema.org/GeoCoordinates, http://schema.org/GeoShape, http://schema.org/PostalAddress', 'http://schema.org/Country, http://schema.org/Text', '', '', ''),
(40, 'http://schema.org/addressLocality', 'addressLocality', 'DirecciÃ³n Localidad', 'The locality. For example, Mountain View.', '', '', '', 'http://schema.org/PostalAddress', 'http://schema.org/Text', '', '', ''),
(41, 'http://schema.org/addressRegion', 'addressRegion', 'DirecciÃ³n RegiÃ³n', 'The region. For example, CA.', '', '', '', 'http://schema.org/PostalAddress', 'http://schema.org/Text', '', '', ''),
(42, 'http://schema.org/administrationRoute', 'administrationRoute', 'Ruta de administraciÃ³n', 'A route by which this drug may be administered, e.g. \'oral\'.', '', '', '', 'http://schema.org/Drug', 'http://schema.org/Text', '', '', ''),
(43, 'http://schema.org/advanceBookingRequirement', 'advanceBookingRequirement', 'Requisito de reserva previa', 'The amount of time that is required between accepting the offer and the actual usage of the resource or service.', '', '', '', 'http://schema.org/Demand, http://schema.org/Offer', 'http://schema.org/QuantitativeValue', '', '', ''),
(44, 'http://schema.org/adverseOutcome', 'adverseOutcome', 'resultado adverso', 'A possible complication and/or side effect of this therapy. If it is known that an adverse outcome is serious (resulting in death, disability, or permanent damage; requiring hospitalization; or is otherwise life-threatening or requires immediate medical attention), tag it as a seriouseAdverseOutcome instead.', '', '', '', 'http://schema.org/MedicalDevice, http://schema.org/TherapeuticProcedure', 'http://schema.org/MedicalEntity', '', '', ''),
(45, 'http://schema.org/affectedBy', 'affectedBy', 'afectado por', 'Drugs that affect the test\'s results.', '', '', '', 'http://schema.org/MedicalTest', 'http://schema.org/Drug', '', '', ''),
(46, 'http://schema.org/affiliation', 'affiliation', 'afiliaciÃ³n', 'An organization that this person is affiliated with. For example, a school/university, a club, or a team.', 'http://schema.org/memberOf', '', '', 'http://schema.org/Person', 'http://schema.org/Organization', '', '', ''),
(47, 'http://schema.org/agent', 'agent', 'agente', 'The direct performer or driver of the action (animate or inanimate). e.g. <em>John</em> wrote a book.', '', '', '', 'http://schema.org/Action', 'http://schema.org/Organization, http://schema.org/Person', '', '', ''),
(48, 'http://schema.org/aggregateRating', 'aggregateRating', 'CalificaciÃ³n agregada', 'The overall rating, based on a collection of reviews or ratings, of the item.', '', '', '', 'http://schema.org/Brand, http://schema.org/CreativeWork, http://schema.org/Event, http://schema.org/Offer, http://schema.org/Organization, http://schema.org/Place, http://schema.org/Product, http://schema.org/Service', 'http://schema.org/AggregateRating', '', '', ''),
(49, 'http://schema.org/aircraft', 'aircraft', 'aeronave', 'The kind of aircraft (e.g., \"Boeing 747\").', '', '', '', 'http://schema.org/Flight', 'http://schema.org/Text, http://schema.org/Vehicle', '', '', ''),
(50, 'http://schema.org/album', 'album', 'Ã¡lbum', 'A music album.', '', '', '', 'http://schema.org/MusicGroup', 'http://schema.org/MusicAlbum', '', 'http://schema.org/albums', ''),
(51, 'http://schema.org/albumProductionType', 'albumProductionType', 'Ãlbum Tipo de producciÃ³n', 'Classification of the album by it\'s type of content: soundtrack, live album, studio album, etc.', '', '', '', 'http://schema.org/MusicAlbum', 'http://schema.org/MusicAlbumProductionType', '', '', ''),
(52, 'http://schema.org/albumRelease', 'albumRelease', 'Lanzamiento del Ã¡lbum', 'A release of this album.', '', '', '', 'http://schema.org/MusicAlbum', 'http://schema.org/MusicRelease', 'http://schema.org/releaseOf', '', ''),
(53, 'http://schema.org/albumReleaseType', 'albumReleaseType', 'Ãlbum Tipo de lanzamiento', 'The kind of release which this album is: single, EP or album.', '', '', '', 'http://schema.org/MusicAlbum', 'http://schema.org/MusicAlbumReleaseType', '', '', ''),
(54, 'http://schema.org/albums', 'albums', 'Ãlbumes', 'A collection of music albums.', '', '', '', 'http://schema.org/MusicGroup', 'http://schema.org/MusicAlbum', '', '', 'http://schema.org/album'),
(55, 'http://schema.org/alcoholWarning', 'alcoholWarning', 'Advertencia de alcohol', 'Any precaution, guidance, contraindication, etc. related to consumption of alcohol while taking this drug.', '', '', '', 'http://schema.org/Drug', 'http://schema.org/Text', '', '', ''),
(56, 'http://schema.org/algorithm', 'algorithm', 'algoritmo', 'The algorithm or rules to follow to compute the score.', '', '', '', 'http://schema.org/MedicalRiskScore', 'http://schema.org/Text', '', '', ''),
(57, 'http://schema.org/alignmentType', 'alignmentType', 'AlineaciÃ³n Tipo', 'A category of alignment between the learning resource and the framework node. Recommended values include: \'assesses\', \'teaches\', \'requires\', \'textComplexity\', \'readingLevel\', \'educationalSubject\', and \'educationalLevel\'.', '', '', '', 'http://schema.org/AlignmentObject', 'http://schema.org/Text', '', '', ''),
(58, 'http://schema.org/alternateName', 'alternateName', 'Nombre alternativo', 'An alias for the item.', '', '', '', 'http://schema.org/Thing', 'http://schema.org/Text', '', '', ''),
(59, 'http://schema.org/alternativeHeadline', 'alternativeHeadline', 'TÃ­tulo alternativo', 'A secondary title of the CreativeWork.', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/Text', '', '', ''),
(60, 'http://schema.org/alumni', 'alumni', 'Antiguos alumnos', 'Alumni of an organization.', '', '', '', 'http://schema.org/EducationalOrganization, http://schema.org/Organization', 'http://schema.org/Person', 'http://schema.org/alumniOf', '', ''),
