(410, 'http://schema.org/flightNumber', 'flightNumber', 'nÃºmero de vuelo', 'The unique identifier for a flight including the airline IATA code. For example, if describing United flight 110, where the IATA code for United is \'UA\', the flightNumber is \'UA110\'.', 'http://schema.org/identifier', '', '', 'http://schema.org/Flight', 'http://schema.org/Text', '', '', ''),
