(426, 'http://schema.org/fuelCapacity', 'fuelCapacity', 'capacidad de combustible', 'The capacity of the fuel tank or in the case of electric cars, the battery. If there are multiple components for storage, this should indicate the total of all storage of the same type.</p>\n\n<p>Typical unit code(s): LTR for liters, GLL of US gallons, GLI for UK / imperial gallons, AMH for ampere-hours (for electrical vehicles).', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/QuantitativeValue', '', '', ''),
(427, 'http://schema.org/fuelConsumption', 'fuelConsumption', 'el consumo de combustible', '<p>The amount of fuel consumed for traveling a particular distance or temporal duration with the given vehicle (e.g. liters per 100 km).</p>\n\n<ul>\n<li>Note 1: There are unfortunately no standard unit codes for liters per 100 km.  Use <a class=\"localLink\" href=\"http://schema.org/unitText\">unitText</a> to indicate the unit of measurement, e.g. L/100 km.</li>\n<li>Note 2: There are two ways of indicating the fuel consumption, <a class=\"localLink\" href=\"http://schema.org/fuelConsumption\">fuelConsumption</a> (e.g. 8 liters per 100 km) and <a class=\"localLink\" href=\"http://schema.org/fuelEfficiency\">fuelEfficiency</a> (e.g. 30 miles per gallon). They are reciprocal.</li>\n<li>Note 3: Often, the absolute value is useful only when related to driving speed (\"at 80 km/h\") or usage pattern (\"city traffic\"). You can use <a class=\"localLink\" href=\"http://schema.org/valueReference\">valueReference</a> to link the value for the fuel consumption to another value.</li>\n</ul>\n', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/QuantitativeValue', '', '', ''),
(428, 'http://schema.org/fuelEfficiency', 'fuelEfficiency', 'eficiencia de combustible', '<p>The distance traveled per unit of fuel used; most commonly miles per gallon (mpg) or kilometers per liter (km/L).</p>\n\n<ul>\n<li>Note 1: There are unfortunately no standard unit codes for miles per gallon or kilometers per liter. Use <a class=\"localLink\" href=\"http://schema.org/unitText\">unitText</a> to indicate the unit of measurement, e.g. mpg or km/L.</li>\n<li>Note 2: There are two ways of indicating the fuel consumption, <a class=\"localLink\" href=\"http://schema.org/fuelConsumption\">fuelConsumption</a> (e.g. 8 liters per 100 km) and <a class=\"localLink\" href=\"http://schema.org/fuelEfficiency\">fuelEfficiency</a> (e.g. 30 miles per gallon). They are reciprocal.</li>\n<li>Note 3: Often, the absolute value is useful only when related to driving speed (\"at 80 km/h\") or usage pattern (\"city traffic\"). You can use <a class=\"localLink\" href=\"http://schema.org/valueReference\">valueReference</a> to link the value for the fuel economy to another value.</li>\n</ul>\n', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/QuantitativeValue', '', '', ''),
(429, 'http://schema.org/fuelType', 'fuelType', 'tipo de combustible', 'The type of fuel suitable for the engine or engines of the vehicle. If the vehicle has only one engine, this property can be attached directly to the vehicle.', '', '', '', 'http://schema.org/EngineSpecification, http://schema.org/Vehicle', 'http://schema.org/QualitativeValue, http://schema.org/Text, http://schema.org/URL', '', '', ''),
(430, 'http://schema.org/function', 'function', 'funciÃ³n', 'Function of the anatomical structure.', '', '', '', 'http://schema.org/AnatomicalStructure', 'http://schema.org/Text', '', '', ''),
(431, 'http://schema.org/functionalClass', 'functionalClass', 'Clase funcional', 'The degree of mobility the joint allows.', '', '', '', 'http://schema.org/Joint', 'http://schema.org/MedicalEntity, http://schema.org/Text', '', '', ''),
(432, 'http://schema.org/funder', 'funder', 'Financiador', 'A person or organization that supports (sponsors) something through some kind of financial contribution.', 'http://schema.org/sponsor', '', '', 'http://schema.org/CreativeWork, http://schema.org/Event, http://schema.org/Organization, http://schema.org/Person', 'http://schema.org/Organization, http://schema.org/Person', '', '', ''),
(433, 'http://schema.org/game', 'game', 'juego', 'Video game which is played on this server.', '', '', '', 'http://schema.org/GameServer', 'http://schema.org/VideoGame', 'http://schema.org/gameServer', '', ''),
(434, 'http://schema.org/gameItem', 'gameItem', 'Juego', 'An item is an object within the game world that can be collected by a player or, occasionally, a non-player character.', '', '', '', 'http://schema.org/Game, http://schema.org/VideoGameSeries', 'http://schema.org/Thing', '', '', ''),
(435, 'http://schema.org/gameLocation', 'gameLocation', 'UbicaciÃ³n del juego', 'Real or fictional location of the game (or part of game).', '', '', '', 'http://schema.org/Game, http://schema.org/VideoGameSeries', 'http://schema.org/Place, http://schema.org/PostalAddress, http://schema.org/URL', '', '', ''),
(436, 'http://schema.org/gamePlatform', 'gamePlatform', 'Plataforma de juego', 'The electronic systems used to play <a href=\"http://en.wikipedia.org/wiki/Category:Video_game_platforms\">video games</a>.', '', '', '', 'http://schema.org/VideoGame, http://schema.org/VideoGameSeries', 'http://schema.org/Text, http://schema.org/Thing, http://schema.org/URL', '', '', ''),
(437, 'http://schema.org/gameServer', 'gameServer', 'Servidor de juegos', 'The server on which  it is possible to play the game.', '', '', '', 'http://schema.org/VideoGame', 'http://schema.org/GameServer', 'http://schema.org/game', '', ''),
(438, 'http://schema.org/gameTip', 'gameTip', 'Sugerencia de juego', 'Links to tips, tactics, etc.', '', '', '', 'http://schema.org/VideoGame', 'http://schema.org/CreativeWork', '', '', ''),
(439, 'http://schema.org/gender', 'gender', 'gÃ©nero', 'Gender of the person. While http://schema.org/Male and http://schema.org/Female may be used, text strings are also acceptable for people who do not identify as a binary gender.', '', '', '', 'http://schema.org/Person', 'http://schema.org/GenderType, http://schema.org/Text', '', '', ''),
(440, 'http://schema.org/genre', 'genre', 'gÃ©nero', 'Genre of the creative work, broadcast channel or group.', '', '', '', 'http://schema.org/BroadcastChannel, http://schema.org/CreativeWork, http://schema.org/MusicGroup', 'http://schema.org/Text, http://schema.org/URL', '', '', ''),
(441, 'http://schema.org/geo', 'geo', 'geo', 'The geo coordinates of the place.', '', '', '', 'http://schema.org/Place', 'http://schema.org/GeoCoordinates, http://schema.org/GeoShape', '', '', ''),
(442, 'http://schema.org/geoMidpoint', 'geoMidpoint', 'GeoMidpoint', 'Indicates the GeoCoordinates at the centre of a GeoShape e.g. GeoCircle.', '', '', '', 'http://schema.org/GeoCircle', 'http://schema.org/GeoCoordinates', '', '', ''),
(443, 'http://schema.org/geoRadius', 'geoRadius', 'Radio geogrÃ¡fico', 'Indicates the approximate radius of a GeoCircle (metres unless indicated otherwise via Distance notation).', '', '', '', 'http://schema.org/GeoCircle', 'http://schema.org/Distance, http://schema.org/Number, http://schema.org/Text', '', '', ''),
(444, 'http://schema.org/geographicArea', 'geographicArea', 'Ã¡rea geogrÃ¡fica', 'The geographic area associated with the audience.', '', '', '', 'http://schema.org/Audience', 'http://schema.org/AdministrativeArea', '', '', ''),
(445, 'http://schema.org/geospatiallyContains', 'geospatiallyContains', 'Geospatially Contiene', 'Represents a relationship between two geometries (or the places they represent), relating a containing geometry to a contained geometry. \"a contains b iff no points of b lie in the exterior of a, and at least one point of the interior of b lies in the interior of a\". As defined in <a href=\"https://en.wikipedia.org/wiki/DE-9IM\">DE-9IM</a>.', '', '', '', 'http://schema.org/GeospatialGeometry, http://schema.org/Place', 'http://schema.org/GeospatialGeometry, http://schema.org/Place', '', '', ''),
(446, 'http://schema.org/geospatiallyCoveredBy', 'geospatiallyCoveredBy', 'Geospatially cubierto por', 'Represents a relationship between two geometries (or the places they represent), relating a geometry to another that covers it. As defined in <a href=\"https://en.wikipedia.org/wiki/DE-9IM\">DE-9IM</a>.', '', '', '', 'http://schema.org/GeospatialGeometry, http://schema.org/Place', 'http://schema.org/GeospatialGeometry, http://schema.org/Place', '', '', ''),
(447, 'http://schema.org/geospatiallyCovers', 'geospatiallyCovers', 'Cubiertas geospatially', 'Represents a relationship between two geometries (or the places they represent), relating a covering geometry to a covered geometry. \"Every point of b is a point of (the interior or boundary of) a\". As defined in <a href=\"https://en.wikipedia.org/wiki/DE-9IM\">DE-9IM</a>.', '', '', '', 'http://schema.org/GeospatialGeometry, http://schema.org/Place', 'http://schema.org/GeospatialGeometry, http://schema.org/Place', '', '', ''),
(448, 'http://schema.org/geospatiallyCrosses', 'geospatiallyCrosses', 'Geospatially Cruces', 'Represents a relationship between two geometries (or the places they represent), relating a geometry to another that crosses it: \"a crosses b: they have some but not all interior points in common, and the dimension of the intersection is less than that of at least one of them\". As defined in <a href=\"https://en.wikipedia.org/wiki/DE-9IM\">DE-9IM</a>.', '', '', '', 'http://schema.org/GeospatialGeometry, http://schema.org/Place', 'http://schema.org/GeospatialGeometry, http://schema.org/Place', '', '', ''),
(449, 'http://schema.org/geospatiallyDisjoint', 'geospatiallyDisjoint', 'Disociar geospatially', 'Represents spatial relations in which two geometries (or the places they represent) are topologically disjoint: they have no point in common. They form a set of disconnected geometries.\" (a symmetric relationship, as defined in <a href=\"https://en.wikipedia.org/wiki/DE-9IM\">DE-9IM</a>)', '', '', '', 'http://schema.org/GeospatialGeometry, http://schema.org/Place', 'http://schema.org/GeospatialGeometry, http://schema.org/Place', '', '', ''),
(450, 'http://schema.org/geospatiallyEquals', 'geospatiallyEquals', 'Geospatially iguales', 'Represents spatial relations in which two geometries (or the places they represent) are topologically equal, as defined in <a href=\"https://en.wikipedia.org/wiki/DE-9IM\">DE-9IM</a>. \"Two geometries are topologically equal if their interiors intersect and no part of the interior or boundary of one geometry intersects the exterior of the other\" (a symmetric relationship)', '', '', '', 'http://schema.org/GeospatialGeometry, http://schema.org/Place', 'http://schema.org/GeospatialGeometry, http://schema.org/Place', '', '', ''),
(451, 'http://schema.org/geospatiallyIntersects', 'geospatiallyIntersects', 'Intersecciones geoespaciales', 'Represents spatial relations in which two geometries (or the places they represent) have at least one point in common. As defined in <a href=\"https://en.wikipedia.org/wiki/DE-9IM\">DE-9IM</a>.', '', '', '', 'http://schema.org/GeospatialGeometry, http://schema.org/Place', 'http://schema.org/GeospatialGeometry, http://schema.org/Place', '', '', ''),
(452, 'http://schema.org/geospatiallyOverlaps', 'geospatiallyOverlaps', 'Superposiciones geoespaciales', 'Represents a relationship between two geometries (or the places they represent), relating a geometry to another that geospatially overlaps it, i.e. they have some but not all points in common. As defined in <a href=\"https://en.wikipedia.org/wiki/DE-9IM\">DE-9IM</a>.', '', '', '', 'http://schema.org/GeospatialGeometry, http://schema.org/Place', 'http://schema.org/GeospatialGeometry, http://schema.org/Place', '', '', ''),
(453, 'http://schema.org/geospatiallyTouches', 'geospatiallyTouches', 'Toques geoespaciales', 'Represents spatial relations in which two geometries (or the places they represent) touch: they have at least one boundary point in common, but no interior points.\" (a symmetric relationship, as defined in <a href=\"https://en.wikipedia.org/wiki/DE-9IM\">DE-9IM</a> )', '', '', '', 'http://schema.org/GeospatialGeometry, http://schema.org/Place', 'http://schema.org/GeospatialGeometry, http://schema.org/Place', '', '', ''),
(454, 'http://schema.org/geospatiallyWithin', 'geospatiallyWithin', 'Geospatially dentro', 'Represents a relationship between two geometries (or the places they represent), relating a geometry to one that contains it, i.e. it is inside (i.e. within) its interior. As defined in <a href=\"https://en.wikipedia.org/wiki/DE-9IM\">DE-9IM</a>.', '', '', '', 'http://schema.org/GeospatialGeometry, http://schema.org/Place', 'http://schema.org/GeospatialGeometry, http://schema.org/Place', '', '', ''),
(455, 'http://schema.org/givenName', 'givenName', 'nombre de pila', 'Given name. In the U.S., the first name of a Person. This can be used along with familyName instead of the name property.', '', '', '', 'http://schema.org/Person', 'http://schema.org/Text', '', '', ''),
(456, 'http://schema.org/globalLocationNumber', 'globalLocationNumber', 'NÃºmero de ubicaciÃ³n global', 'The <a href=\"http://www.gs1.org/gln\">Global Location Number</a> (GLN, sometimes also referred to as International Location Number or ILN) of the respective organization, person, or place. The GLN is a 13-digit number used to identify parties and physical locations.', 'http://schema.org/identifier', '', '', 'http://schema.org/Organization, http://schema.org/Person, http://schema.org/Place', 'http://schema.org/Text', '', '', ''),
(457, 'http://schema.org/gracePeriod', 'gracePeriod', 'periodo de gracia', 'The period of time after any due date that the borrower has to fulfil its obligations before a default (failure to pay) is deemed to have occurred.', '', '', '', 'http://schema.org/LoanOrCredit', 'http://schema.org/Duration', '', '', ''),
(458, 'http://schema.org/grantee', 'grantee', 'Concesionario', 'The person, organization, contact point, or audience that has been granted this permission.', '', '', '', 'http://schema.org/DigitalDocumentPermission', 'http://schema.org/Audience, http://schema.org/ContactPoint, http://schema.org/Organization, http://schema.org/Person', '', '', ''),
(459, 'http://schema.org/greater', 'greater', 'Mayor', 'This ordering relation for qualitative values indicates that the subject is greater than the object.', '', '', '', 'http://schema.org/QualitativeValue', 'http://schema.org/QualitativeValue', '', '', ''),
(460, 'http://schema.org/greaterOrEqual', 'greaterOrEqual', 'Mayor o igual', 'This ordering relation for qualitative values indicates that the subject is greater than or equal to the object.', '', '', '', 'http://schema.org/QualitativeValue', 'http://schema.org/QualitativeValue', '', '', ''),
(461, 'http://schema.org/gtin12', 'gtin12', 'Gtin12', 'The <a href=\"http://apps.gs1.org/GDD/glossary/Pages/GTIN-12.aspx\">GTIN-12</a> code of the product, or the product to which the offer refers. The GTIN-12 is the 12-digit GS1 Identification Key composed of a U.P.C. Company Prefix, Item Reference, and Check Digit used to identify trade items. See <a href=\"http://www.gs1.org/barcodes/technical/idkeys/gtin\">GS1 GTIN Summary</a> for more details.', 'http://schema.org/identifier', '', '', 'http://schema.org/Demand, http://schema.org/Offer, http://schema.org/Product', 'http://schema.org/Text', '', '', ''),
(462, 'http://schema.org/gtin13', 'gtin13', 'Gtin13', 'The <a href=\"http://apps.gs1.org/GDD/glossary/Pages/GTIN-13.aspx\">GTIN-13</a> code of the product, or the product to which the offer refers. This is equivalent to 13-digit ISBN codes and EAN UCC-13. Former 12-digit UPC codes can be converted into a GTIN-13 code by simply adding a preceeding zero. See <a href=\"http://www.gs1.org/barcodes/technical/idkeys/gtin\">GS1 GTIN Summary</a> for more details.', 'http://schema.org/identifier', '', '', 'http://schema.org/Demand, http://schema.org/Offer, http://schema.org/Product', 'http://schema.org/Text', '', '', ''),
(463, 'http://schema.org/gtin14', 'gtin14', 'Gtin14', 'The <a href=\"http://apps.gs1.org/GDD/glossary/Pages/GTIN-14.aspx\">GTIN-14</a> code of the product, or the product to which the offer refers. See <a href=\"http://www.gs1.org/barcodes/technical/idkeys/gtin\">GS1 GTIN Summary</a> for more details.', 'http://schema.org/identifier', '', '', 'http://schema.org/Demand, http://schema.org/Offer, http://schema.org/Product', 'http://schema.org/Text', '', '', ''),
(464, 'http://schema.org/gtin8', 'gtin8', 'Gtin8', 'The <a href=\"http://apps.gs1.org/GDD/glossary/Pages/GTIN-8.aspx\">GTIN-8</a> code of the product, or the product to which the offer refers. This code is also known as EAN/UCC-8 or 8-digit EAN. See <a href=\"http://www.gs1.org/barcodes/technical/idkeys/gtin\">GS1 GTIN Summary</a> for more details.', 'http://schema.org/identifier', '', '', 'http://schema.org/Demand, http://schema.org/Offer, http://schema.org/Product', 'http://schema.org/Text', '', '', ''),
