(469, 'http://schema.org/hasCategoryCode', 'hasCategoryCode', 'Tiene un cÃ³digo de categorÃ­a', 'A Category code contained in this code set.', 'http://schema.org/hasPart', '', '', 'http://schema.org/CategoryCodeSet', 'http://schema.org/CategoryCode', '', '', ''),
