(792, 'http://schema.org/previousItem', 'previousItem', 'ArtÃ­culo anterior', 'A link to the ListItem that preceeds the current one.', '', '', '', 'http://schema.org/ListItem', 'http://schema.org/ListItem', '', '', ''),
(793, 'http://schema.org/previousStartDate', 'previousStartDate', 'Fecha de inicio anterior', 'Used in conjunction with eventStatus for rescheduled or cancelled events. This property contains the previously scheduled start date. For rescheduled events, the startDate property should be used for the newly scheduled start date. In the (rare) case of an event that has been postponed and rescheduled multiple times, this field may be repeated.', '', '', '', 'http://schema.org/Event', 'http://schema.org/Date', '', '', ''),
(794, 'http://schema.org/price', 'price', 'precio', '<p>The offer price of a product, or of a price component when attached to PriceSpecification and its subtypes.</p>\n\n<p>Usage guidelines:</p>\n\n<ul>\n<li>Use the <a class=\"localLink\" href=\"http://schema.org/priceCurrency\">priceCurrency</a> property (with <a href=\"http://en.wikipedia.org/wiki/ISO_4217#Active_codes\">ISO 4217 codes</a> e.g. \"USD\") instead of\n  including <a href=\"http://en.wikipedia.org/wiki/Dollar_sign#Currencies_that_use_the_dollar_or_peso_sign\">ambiguous symbols</a> such as \'$\' in the value.</li>\n<li>Use \'.\' (Unicode \'FULL STOP\' (U+002E)) rather than \',\' to indicate a decimal point. Avoid using these symbols as a readability separator.</li>\n<li>Note that both <a href=\"http://www.w3.org/TR/xhtml-rdfa-primer/#using-the-content-attribute\">RDFa</a> and Microdata syntax allow the use of a \"content=\" attribute for publishing simple machine-readable values alongside more human-friendly formatting.</li>\n<li>Use values from 0123456789 (Unicode \'DIGIT ZERO\' (U+0030) to \'DIGIT NINE\' (U+0039)) rather than superficially similiar Unicode symbols.</li>\n</ul>\n', '', '', '', 'http://schema.org/Offer, http://schema.org/PriceSpecification, http://schema.org/TradeAction', 'http://schema.org/Number, http://schema.org/Text', '', '', ''),
(795, 'http://schema.org/priceComponent', 'priceComponent', 'Precio Componente', 'This property links to all <a class=\"localLink\" href=\"http://schema.org/UnitPriceSpecification\">UnitPriceSpecification</a> nodes that apply in parallel for the <a class=\"localLink\" href=\"http://schema.org/CompoundPriceSpecification\">CompoundPriceSpecification</a> node.', '', '', '', 'http://schema.org/CompoundPriceSpecification', 'http://schema.org/UnitPriceSpecification', '', '', ''),
(796, 'http://schema.org/priceCurrency', 'priceCurrency', 'Moneda', 'The currency (in 3-letter ISO 4217 format) of the price or a price component, when attached to <a class=\"localLink\" href=\"http://schema.org/PriceSpecification\">PriceSpecification</a> and its subtypes.', '', '', '', 'http://schema.org/Offer, http://schema.org/PriceSpecification, http://schema.org/Reservation, http://schema.org/Ticket', 'http://schema.org/Text', '', '', ''),
