(798, 'http://schema.org/priceSpecification', 'priceSpecification', 'Precio EspecificaciÃ³n', 'One or more detailed price specifications, indicating the unit price and delivery or payment charges.', '', '', '', 'http://schema.org/Demand, http://schema.org/Offer, http://schema.org/TradeAction', 'http://schema.org/PriceSpecification', '', '', ''),
(799, 'http://schema.org/priceType', 'priceType', 'Precio Tipo', 'A short text or acronym indicating multiple price specifications for the same offer, e.g. SRP for the suggested retail price or INVOICE for the invoice price, mostly used in the car industry.', '', '', '', 'http://schema.org/UnitPriceSpecification', 'http://schema.org/Text', '', '', ''),
