(822, 'http://schema.org/propertyID', 'propertyID', 'ID de propiedad', 'A commonly used identifier for the characteristic represented by the property, e.g. a manufacturer or a standard code for a property. propertyID can be\n(1) a prefixed string, mainly meant to be used with standards for product properties; (2) a site-specific, non-prefixed string (e.g. the primary key of the property or the vendor-specific id of the property), or (3)\na URL indicating the type of the property, either pointing to an external vocabulary, or a Web resource that describes the property (e.g. a glossary entry).\nStandards bodies should promote a standard prefix for the identifiers of properties from their standards.', '', '', '', 'http://schema.org/PropertyValue', 'http://schema.org/Text, http://schema.org/URL', '', '', ''),
