(948, 'http://schema.org/serviceLocation', 'serviceLocation', 'Servicio UbicaciÃ³n', 'The location (e.g. civic structure, local business, etc.) where a person can go to access the service.', '', '', '', 'http://schema.org/ServiceChannel', 'http://schema.org/Place', '', '', ''),
