(961, 'http://schema.org/signOrSymptom', 'signOrSymptom', 'Signo o sÃ­ntoma', 'A sign or symptom of this condition. Signs are objective or physically observable manifestations of the medical condition while symptoms are the subjective experience of the medical condition.', '', '', '', 'http://schema.org/MedicalCondition', 'http://schema.org/MedicalSignOrSymptom', '', '', ''),
(962, 'http://schema.org/significance', 'significance', 'significado', 'The significance associated with the superficial anatomy; as an example, how characteristics of the superficial anatomy can suggest underlying medical conditions or courses of treatment.', '', '', '', 'http://schema.org/SuperficialAnatomy', 'http://schema.org/Text', '', '', ''),
(963, 'http://schema.org/significantLink', 'significantLink', 'Enlace significativo', 'One of the more significant URLs on the page. Typically, these are the non-navigation links that are clicked on the most.', '', '', '', 'http://schema.org/WebPage', 'http://schema.org/URL', '', 'http://schema.org/significantLinks', ''),
