(967, 'http://schema.org/smokingAllowed', 'smokingAllowed', 'fumar estÃ¡ permitido', 'Indicates whether it is allowed to smoke in the place, e.g. in the restaurant, hotel or hotel room.', '', '', '', 'http://schema.org/Place', 'http://schema.org/Boolean', '', '', ''),
