(969, 'http://schema.org/softwareAddOn', 'softwareAddOn', 'Software AÃ±adir', 'Additional content for a software application.', '', '', '', 'http://schema.org/SoftwareApplication', 'http://schema.org/SoftwareApplication', '', '', ''),
