(971, 'http://schema.org/softwareRequirements', 'softwareRequirements', 'Requisitos de Software', 'Component dependency requirements for application. This includes runtime environments and shared libraries that are not included in the application distribution package, but required to run the application (Examples: DirectX, Java or .NET runtime).', '', '', '', 'http://schema.org/SoftwareApplication', 'http://schema.org/Text, http://schema.org/URL', '', 'http://schema.org/requirements', ''),
