(974, 'http://schema.org/sourceOrganization', 'sourceOrganization', 'OrganizaciÃ³n fuente', 'The Organization on whose behalf the creator was working.', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/Organization', '', '', ''),
(975, 'http://schema.org/sourcedFrom', 'sourcedFrom', 'Procedentes de', 'The neurological pathway that originates the neurons.', '', '', '', 'http://schema.org/Nerve', 'http://schema.org/BrainStructure', '', '', ''),
(976, 'http://schema.org/spatial', 'spatial', 'espacial', 'The range of spatial applicability of a dataset, e.g. for a dataset of New York weather, the state of New York.', '', 'http://purl.org/dc/terms/spatial', '', 'http://schema.org/Dataset', 'http://schema.org/Place', '', '', 'http://schema.org/spatialCoverage'),
(977, 'http://schema.org/spatialCoverage', 'spatialCoverage', 'Cobertura espacial', 'The spatialCoverage of a CreativeWork indicates the place(s) which are the focus of the content. It is a subproperty of\n      contentLocation intended primarily for more technical and detailed materials. For example with a Dataset, it indicates\n      areas that the dataset describes: a dataset of New York weather would have spatialCoverage which was the place: the state of New York.', 'http://schema.org/contentLocation', 'http://purl.org/dc/terms/spatial', '', 'http://schema.org/CreativeWork', 'http://schema.org/Place', '', 'http://schema.org/spatial', ''),
(978, 'http://schema.org/speakable', 'speakable', 'Hablable', 'Indicates sections of a Web page that are particularly \'speakable\' in the sense of being highlighted as being especially appropriate for text-to-speech conversion. Other sections of a page may also be usefully spoken in particular circumstances; the \'speakable\' property serves to indicate the parts most likely to be generally useful for speech.</p>\n\n<p>The <em>speakable</em> property can be repeated an arbitrary number of times, with three kinds of possible \'content-locator\' values:</p>\n\n<p>1.) <em>id-value</em> URL references - uses <em>id-value</em> of an element in the page being annotated. The simplest use of <em>speakable</em> has (potentially relative) URL values, referencing identified sections of the document concerned.</p>\n\n<p>2.) CSS Selectors - addresses content in the annotated page, eg. via class attribute. Use the <a class=\"localLink\" href=\"http://schema.org/cssSelector\">cssSelector</a> property.</p>\n\n<p>3.)  XPaths - addresses content via XPaths (assuming an XML view of the content). Use the <a class=\"localLink\" href=\"http://schema.org/xpath\">xpath</a> property.</p>\n\n<p>For more sophisticated markup of speakable sections beyond simple ID references, either CSS selectors or XPath expressions to pick out document section(s) as speakable. For this\nwe define a supporting type, <a class=\"localLink\" href=\"http://schema.org/SpeakableSpecification\">SpeakableSpecification</a>  which is defined to be a possible value of the <em>speakable</em> property.', '', '', '', 'http://schema.org/WebPage', 'http://schema.org/SpeakableSpecification, http://schema.org/URL', '', '', ''),
(979, 'http://schema.org/specialCommitments', 'specialCommitments', 'Compromisos especiales', 'Any special commitments associated with this job posting. Valid entries include VeteranCommit, MilitarySpouseCommit, etc.', '', '', '', 'http://schema.org/JobPosting', 'http://schema.org/Text', '', '', ''),
(980, 'http://schema.org/specialOpeningHoursSpecification', 'specialOpeningHoursSpecification', 'Especificaciones especiales', 'The special opening hours of a certain place.</p>\n\n<p>Use this to explicitly override general opening hours brought in scope by <a class=\"localLink\" href=\"http://schema.org/openingHoursSpecification\">openingHoursSpecification</a> or <a class=\"localLink\" href=\"http://schema.org/openingHours\">openingHours</a>.', '', '', '', 'http://schema.org/Place', 'http://schema.org/OpeningHoursSpecification', '', '', ''),
(981, 'http://schema.org/specialty', 'specialty', 'especialidad', 'One of the domain specialities to which this web page\'s content applies.', '', '', '', 'http://schema.org/WebPage', 'http://schema.org/Specialty', '', '', ''),
(982, 'http://schema.org/speed', 'speed', 'velocidad', 'The speed range of the vehicle. If the vehicle is powered by an engine, the upper limit of the speed range (indicated by <a class=\"localLink\" href=\"http://schema.org/maxValue\">maxValue</a> should be the maximum speed achievable under regular conditions.</p>\n\n<p>Typical unit code(s): KMH for km/h, HM for mile per hour (0.447 04 m/s), KNT for knot</p>\n\n<p>*Note 1: Use <a class=\"localLink\" href=\"http://schema.org/minValue\">minValue</a> and <a class=\"localLink\" href=\"http://schema.org/maxValue\">maxValue</a> to indicate the range. Typically, the minimal value is zero.\n* Note 2: There are many different ways of measuring the speed range. You can link to information about how the given value has been determined using the <a class=\"localLink\" href=\"http://schema.org/valueReference\">valueReference</a> property.', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/QuantitativeValue', '', '', '');
