(992, 'http://schema.org/starRating', 'starRating', 'Estrellas', 'An official rating for a lodging business or food establishment, e.g. from national associations or standards bodies. Use the author property to indicate the rating organization, e.g. as an Organization with name such as (e.g. HOTREC, DEHOGA, WHR, or Hotelstars).', '', '', '', 'http://schema.org/FoodEstablishment, http://schema.org/LodgingBusiness', 'http://schema.org/Rating', '', '', ''),
(993, 'http://schema.org/startDate', 'startDate', 'fecha de inicio', 'The start date and time of the item (in <a href=\"http://en.wikipedia.org/wiki/ISO_8601\">ISO 8601 date format</a>).', '', '', '', 'http://schema.org/CreativeWorkSeason, http://schema.org/CreativeWorkSeries, http://schema.org/DatedMoneySpecification, http://schema.org/Event, http://schema.org/Role', 'http://schema.org/Date, http://schema.org/DateTime', '', '', ''),
(994, 'http://schema.org/startTime', 'startTime', 'hora de inicio', 'The startTime of something. For a reserved event or service (e.g. FoodEstablishmentReservation), the time that it is expected to start. For actions that span a period of time, when the action was performed. e.g. John wrote a book from <em>January</em> to December.</p>\n\n<p>Note that Event uses startDate/endDate instead of startTime/endTime, even when describing dates with times. This situation may be clarified in future revisions.', '', '', '', 'http://schema.org/Action, http://schema.org/FoodEstablishmentReservation', 'http://schema.org/DateTime', '', '', ''),
