(1039, 'http://schema.org/temporalCoverage', 'temporalCoverage', 'Cobertura temporal', 'The temporalCoverage of a CreativeWork indicates the period that the content applies to, i.e. that it describes, either as a DateTime or as a textual string indicating a time period in <a href=\"https://en.wikipedia.org/wiki/ISO_8601#Time_intervals\">ISO 8601 time interval format</a>. In\n      the case of a Dataset it will typically indicate the relevant time period in a precise notation (e.g. for a 2011 census dataset, the year 2011 would be written \"2011/2012\"). Other forms of content e.g. ScholarlyArticle, Book, TVSeries or TVEpisode may indicate their temporalCoverage in broader terms - textually or via well-known URL.\n      Written works such as books may sometimes have precise temporal coverage too, e.g. a work set in 1939 - 1945 can be indicated in ISO 8601 interval format format via \"1939/1945\".', '', 'http://purl.org/dc/terms/temporal', '', 'http://schema.org/CreativeWork', 'http://schema.org/DateTime, http://schema.org/Text, http://schema.org/URL', '', 'http://schema.org/datasetTimeInterval, http://schema.org/temporal', ''),
