(1110, 'http://schema.org/vehicleSeatingCapacity', 'vehicleSeatingCapacity', 'Capacidad del asiento del vehÃ­culo', 'The number of passengers that can be seated in the vehicle, both in terms of the physical space available, and in terms of limitations set by law.</p>\n\n<p>Typical unit code(s): C62 for persons.', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/Number, http://schema.org/QuantitativeValue', '', '', ''),
(1111, 'http://schema.org/vehicleSpecialUsage', 'vehicleSpecialUsage', 'Uso especial del vehÃ­culo', 'Indicates whether the vehicle has been used for special purposes, like commercial rental, driving school, or as a taxi. The legislation in many countries requires this information to be revealed when offering a car for sale.', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/CarUsageType, http://schema.org/Text', '', '', ''),
(1112, 'http://schema.org/vehicleTransmission', 'vehicleTransmission', 'TransmisiÃ³n del vehÃ­culo', 'The type of component used for transmitting the power from a rotating power source to the wheels or other relevant component(s) (\"gearbox\" for cars).', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/QualitativeValue, http://schema.org/Text, http://schema.org/URL', '', '', ''),
(1113, 'http://schema.org/vendor', 'vendor', 'vendedor', '\'vendor\' is an earlier term for \'seller\'.', 'http://schema.org/participant', '', '', 'http://schema.org/BuyAction', 'http://schema.org/Organization, http://schema.org/Person', '', '', 'http://schema.org/seller'),
(1114, 'http://schema.org/version', 'version', 'versiÃ³n', 'The version of the CreativeWork embodied by a specified resource.', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/Number, http://schema.org/Text', '', '', ''),
(1115, 'http://schema.org/video', 'video', 'vÃ­deo', 'An embedded video object.', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/VideoObject', '', '', ''),
(1116, 'http://schema.org/videoFormat', 'videoFormat', 'formato de video', 'The type of screening or video broadcast used (e.g. IMAX, 3D, SD, HD, etc.).', '', '', '', 'http://schema.org/BroadcastEvent, http://schema.org/BroadcastService, http://schema.org/ScreeningEvent', 'http://schema.org/Text', '', '', ''),
(1117, 'http://schema.org/videoFrameSize', 'videoFrameSize', 'Video TamaÃ±o del marco', 'The frame size of the video.', '', '', '', 'http://schema.org/VideoObject', 'http://schema.org/Text', '', '', ''),
(1118, 'http://schema.org/videoQuality', 'videoQuality', 'calidad de video', 'The quality of the video.', '', '', '', 'http://schema.org/VideoObject', 'http://schema.org/Text', '', '', ''),
(1119, 'http://schema.org/volumeNumber', 'volumeNumber', 'numero de volumen', 'Identifies the volume of publication or multi-part work; for example, \"iii\" or \"2\".', 'http://schema.org/position', 'http://purl.org/ontology/bibo/volume', '', 'http://schema.org/PublicationVolume', 'http://schema.org/Integer, http://schema.org/Text', '', '', ''),
(1120, 'http://schema.org/warning', 'warning', 'advertencia', 'Any FDA or other warnings about the drug (text or URL).', '', '', '', 'http://schema.org/Drug', 'http://schema.org/Text, http://schema.org/URL', '', '', ''),
(1121, 'http://schema.org/warranty', 'warranty', 'garantÃ­a', 'The warranty promise(s) included in the offer.', '', '', '', 'http://schema.org/Demand, http://schema.org/Offer', 'http://schema.org/WarrantyPromise', '', 'http://schema.org/warrantyPromise', ''),
(1122, 'http://schema.org/warrantyPromise', 'warrantyPromise', 'Promesa de garantÃ­a', 'The warranty promise(s) included in the offer.', '', '', '', 'http://schema.org/BuyAction, http://schema.org/SellAction', 'http://schema.org/WarrantyPromise', '', '', 'http://schema.org/warranty'),
(1123, 'http://schema.org/warrantyScope', 'warrantyScope', 'Alcance de la garantÃ­a', 'The scope of the warranty promise.', '', '', '', 'http://schema.org/WarrantyPromise', 'http://schema.org/WarrantyScope', '', '', ''),
(1124, 'http://schema.org/webCheckinTime', 'webCheckinTime', 'Tiempo de registro web', 'The time when a passenger can check into the flight online.', '', '', '', 'http://schema.org/Flight', 'http://schema.org/DateTime', '', '', ''),
(1125, 'http://schema.org/weight', 'weight', 'peso', 'The weight of the product or person.', '', '', '', 'http://schema.org/Person, http://schema.org/Product', 'http://schema.org/QuantitativeValue', '', '', ''),
(1126, 'http://schema.org/weightTotal', 'weightTotal', 'Peso total', '<p>The permitted total weight of the loaded vehicle, including passengers and cargo and the weight of the empty vehicle.</p>\n\n<p>Typical unit code(s): KGM for kilogram, LBR for pound</p>\n\n<ul>\n<li>Note 1: You can indicate additional information in the <a class=\"localLink\" href=\"http://schema.org/name\">name</a> of the <a class=\"localLink\" href=\"http://schema.org/QuantitativeValue\">QuantitativeValue</a> node.</li>\n<li>Note 2: You may also link to a <a class=\"localLink\" href=\"http://schema.org/QualitativeValue\">QualitativeValue</a> node that provides additional information using <a class=\"localLink\" href=\"http://schema.org/valueReference\">valueReference</a>.</li>\n<li>Note 3: Note that you can use <a class=\"localLink\" href=\"http://schema.org/minValue\">minValue</a> and <a class=\"localLink\" href=\"http://schema.org/maxValue\">maxValue</a> to indicate ranges.</li>\n</ul>\n', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/QuantitativeValue', '', '', ''),
(1127, 'http://schema.org/wheelbase', 'wheelbase', 'Distancia entre ejes', 'The distance between the centers of the front and rear wheels.</p>\n\n<p>Typical unit code(s): CMT for centimeters, MTR for meters, INH for inches, FOT for foot/feet', '', '', '', 'http://schema.org/Vehicle', 'http://schema.org/QuantitativeValue', '', '', ''),
(1128, 'http://schema.org/width', 'width', 'anchura', 'The width of the item.', '', '', '', 'http://schema.org/MediaObject, http://schema.org/Product, http://schema.org/VisualArtwork', 'http://schema.org/Distance, http://schema.org/QuantitativeValue', '', '', ''),
(1129, 'http://schema.org/winner', 'winner', 'ganador', 'A sub property of participant. The winner of the action.', 'http://schema.org/participant', '', '', 'http://schema.org/LoseAction', 'http://schema.org/Person', '', '', ''),
(1130, 'http://schema.org/wordCount', 'wordCount', 'el recuento de palabras', 'The number of words in the text of the Article.', '', '', '', 'http://schema.org/Article', 'http://schema.org/Integer', '', '', ''),
(1131, 'http://schema.org/workExample', 'workExample', 'Ejemplo de trabajo', 'Example/instance/realization/derivation of the concept of this creative work. eg. The paperback edition, first edition, or eBook.', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/CreativeWork', 'http://schema.org/exampleOfWork', '', ''),
(1132, 'http://schema.org/workFeatured', 'workFeatured', 'Trabajo destacado', 'A work featured in some event, e.g. exhibited in an ExhibitionEvent.\n       Specific subproperties are available for workPerformed (e.g. a play), or a workPresented (a Movie at a ScreeningEvent).', '', '', 'http://schema.org/workPerformed, http://schema.org/workPresented', 'http://schema.org/Event', 'http://schema.org/CreativeWork', '', '', ''),
(1133, 'http://schema.org/workHours', 'workHours', 'Horas laborales', 'The typical working hours for this job (e.g. 1st shift, night shift, 8am-5pm).', '', '', '', 'http://schema.org/JobPosting', 'http://schema.org/Text', '', '', ''),
(1134, 'http://schema.org/workLocation', 'workLocation', 'ubicaciÃ³n de trabajo', 'A contact location for a person\'s place of work.', 'http://schema.org/location', '', '', 'http://schema.org/Person', 'http://schema.org/ContactPoint, http://schema.org/Place', '', '', ''),
