(1136, 'http://schema.org/workPresented', 'workPresented', 'Trabajo presentado', 'The movie presented during this event.', 'http://schema.org/workFeatured', '', '', 'http://schema.org/ScreeningEvent', 'http://schema.org/Movie', '', '', ''),
(1137, 'http://schema.org/workTranslation', 'workTranslation', 'Trabajo TraducciÃ³n', 'A work that is a translation of the content of this work. e.g. ??? has an English workTranslation “Journey to the West”,a German workTranslation “Monkeys Pilgerfahrt” and a Vietnamese  translation Tây du ký bình kh?o.', '', '', '', 'http://schema.org/CreativeWork', 'http://schema.org/CreativeWork', 'http://schema.org/translationOfWork', '', ''),
(1138, 'http://schema.org/workload', 'workload', 'Carga de trabajo', 'Quantitative measure of the physiologic output of the exercise; also referred to as energy expenditure.', '', '', '', 'http://schema.org/ExercisePlan', 'http://schema.org/Energy, http://schema.org/QualitativeValue', '', '', ''),
(1139, 'http://schema.org/worksFor', 'worksFor', 'trabaja para', 'Organizations that the person works for.', '', '', '', 'http://schema.org/Person', 'http://schema.org/Organization', '', '', ''),
(1140, 'http://schema.org/worstRating', 'worstRating', 'Peor calificaciÃ³n', 'The lowest value allowed in this rating system. If worstRating is omitted, 1 is assumed.', '', '', '', 'http://schema.org/Rating', 'http://schema.org/Number, http://schema.org/Text', '', '', ''),
(1141, 'http://schema.org/xpath', 'xpath', 'Xpath', 'An XPath.', '', '', '', 'http://schema.org/SpeakableSpecification', 'http://schema.org/Text', '', '', ''),
(1142, 'http://schema.org/yearlyRevenue', 'yearlyRevenue', 'Ingresos anuales', 'The size of the business in annual revenue.', '', '', '', 'http://schema.org/BusinessAudience', 'http://schema.org/QuantitativeValue', '', '', ''),
