('http://schema.org/MedicalTherapy', 'MedicalTherapy', 'Any medical intervention designed to prevent, treat, and cure human diseases and medical conditions, including both curative and palliative therapies. Medical therapies are typically processes of care relying upon pharmacotherapy, behavioral therapy, supportive therapy (with fluid or nutrition for example), or detoxification (e.g. hemodialysis) aimed at improving or preventing a health condition.', 'http://schema.org/TherapeuticProcedure', '', 'http://schema.org/additionalType, http://schema.org/adverseOutcome, http://schema.org/alternateName, http://schema.org/bodyLocation, http://schema.org/code, http://schema.org/contraindication, http://schema.org/description, http://schema.org/disambiguatingDescription, http://schema.org/doseSchedule, http://schema.org/drug, http://schema.org/duplicateTherapy, http://schema.org/followup, http://schema.org/guideline, http://schema.org/howPerformed, http://schema.org/identifier, http://schema.org/image, http://schema.org/indication, http://schema.org/indication, http://schema.org/legalStatus, http://schema.org/mainEntityOfPage, http://schema.org/medicineSystem, http://schema.org/name, http://schema.org/outcome, http://schema.org/potentialAction, http://schema.org/preparation, http://schema.org/procedureType, http://schema.org/recognizingAuthority, http://schema.org/relevantSpecialty, http://schema.org/sameAs, http://schema.org/seriousAdverseOutcome, http://schema.org/status, http://schema.org/study, http://schema.org/url', 'http://schema.org/OccupationalTherapy, http://schema.org/PalliativeProcedure, http://schema.org/PhysicalTherapy, http://schema.org/RadiationTherapy, http://schema.org/RespiratoryTherapy', '', '', 'http://health-lifesci.schema.org'),
