(387, 'http://schema.org/MedicalEnumeration', 'MedicalEnumeration', 'EnumeraciÃ³n MÃ©dica', 'Enumerations related to health and the practice of medicine: A concept that is used to attribute a quality to another concept, as a qualifier, a collection of items or a listing of all of the elements of a set in medicine practice.', 'http://schema.org/Enumeration', '', 'http://schema.org/additionalType, http://schema.org/alternateName, http://schema.org/description, http://schema.org/disambiguatingDescription, http://schema.org/identifier, http://schema.org/image, http://schema.org/mainEntityOfPage, http://schema.org/name, http://schema.org/potentialAction, http://schema.org/sameAs, http://schema.org/supersededBy, http://schema.org/url', 'http://schema.org/DrugClass, http://schema.org/DrugCost, http://schema.org/DrugCostCategory, http://schema.org/DrugPregnancyCategory, http://schema.org/DrugPrescriptionStatus, http://schema.org/InfectiousAgentClass, http://schema.org/MedicalAudience, http://schema.org/MedicalDevicePurpose, http://schema.org/MedicalEvidenceLevel, http://schema.org/MedicalImagingTechnique, http://schema.org/MedicalObservationalStudyDesign, http://schema.org/MedicalProcedureType, http://schema.org/MedicalSpecialty, http://schema.org/MedicalStudyStatus, http://schema.org/MedicalTrialDesign, http://schema.org/MedicineSystem, http://schema.org/PhysicalExam', '', '', 'http://health-lifesci.schema.org'),
(388, 'http://schema.org/MedicalEvidenceLevel', 'MedicalEvidenceLevel', 'Nivel de Evidencia MÃ©dica', 'Level of evidence for a medical guideline. Enumerated type.', 'http://schema.org/MedicalEnumeration', '', 'http://schema.org/additionalType, http://schema.org/alternateName, http://schema.org/description, http://schema.org/disambiguatingDescription, http://schema.org/identifier, http://schema.org/image, http://schema.org/mainEntityOfPage, http://schema.org/name, http://schema.org/potentialAction, http://schema.org/sameAs, http://schema.org/supersededBy, http://schema.org/url', '', '', '', 'http://health-lifesci.schema.org'),
(389, 'http://schema.org/MedicalGuideline', 'MedicalGuideline', 'OrientaciÃ³n MÃ©dica', 'Any recommendation made by a standard society (e.g. ACC/AHA) or consensus statement that denotes how to diagnose and treat a particular condition. Note: this type should be used to tag the actual guideline recommendation; if the guideline recommendation occurs in a larger scholarly article, use MedicalScholarlyArticle to tag the overall article, not this type. Note also: the organization making the recommendation should be captured in the recognizingAuthority base property of MedicalEntity.', 'http://schema.org/MedicalEntity', '', 'http://schema.org/additionalType, http://schema.org/alternateName, http://schema.org/code, http://schema.org/description, http://schema.org/disambiguatingDescription, http://schema.org/evidenceLevel, http://schema.org/evidenceOrigin, http://schema.org/guideline, http://schema.org/guidelineDate, http://schema.org/guidelineSubject, http://schema.org/identifier, http://schema.org/image, http://schema.org/legalStatus, http://schema.org/mainEntityOfPage, http://schema.org/medicineSystem, http://schema.org/name, http://schema.org/potentialAction, http://schema.org/recognizingAuthority, http://schema.org/relevantSpecialty, http://schema.org/sameAs, http://schema.org/study, http://schema.org/url', 'http://schema.org/MedicalGuidelineContraindication, http://schema.org/MedicalGuidelineRecommendation', '', '', 'http://health-lifesci.schema.org'),
(390, 'http://schema.org/MedicalGuidelineContraindication', 'MedicalGuidelineContraindication', 'ContraindicaciÃ³n de la GuÃ­a MÃ©dica', 'A guideline contraindication that designates a process as harmful and where quality of the data supporting the contraindication is sound.', 'http://schema.org/MedicalGuideline', '', 'http://schema.org/additionalType, http://schema.org/alternateName, http://schema.org/code, http://schema.org/description, http://schema.org/disambiguatingDescription, http://schema.org/evidenceLevel, http://schema.org/evidenceOrigin, http://schema.org/guideline, http://schema.org/guidelineDate, http://schema.org/guidelineSubject, http://schema.org/identifier, http://schema.org/image, http://schema.org/legalStatus, http://schema.org/mainEntityOfPage, http://schema.org/medicineSystem, http://schema.org/name, http://schema.org/potentialAction, http://schema.org/recognizingAuthority, http://schema.org/relevantSpecialty, http://schema.org/sameAs, http://schema.org/study, http://schema.org/url', '', '', '', 'http://health-lifesci.schema.org'),
(391, 'http://schema.org/MedicalGuidelineRecommendation', 'MedicalGuidelineRecommendation', 'RecomendaciÃ³n de la guÃ­a mÃ©dica', 'A guideline recommendation that is regarded as efficacious and where quality of the data supporting the recommendation is sound.', 'http://schema.org/MedicalGuideline', '', 'http://schema.org/additionalType, http://schema.org/alternateName, http://schema.org/code, http://schema.org/description, http://schema.org/disambiguatingDescription, http://schema.org/evidenceLevel, http://schema.org/evidenceOrigin, http://schema.org/guideline, http://schema.org/guidelineDate, http://schema.org/guidelineSubject, http://schema.org/identifier, http://schema.org/image, http://schema.org/legalStatus, http://schema.org/mainEntityOfPage, http://schema.org/medicineSystem, http://schema.org/name, http://schema.org/potentialAction, http://schema.org/recognizingAuthority, http://schema.org/recommendationStrength, http://schema.org/relevantSpecialty, http://schema.org/sameAs, http://schema.org/study, http://schema.org/url', '', '', '', 'http://health-lifesci.schema.org'),
(392, 'http://schema.org/MedicalImagingTechnique', 'MedicalImagingTechnique', 'TÃ©cnica de ImÃ¡genes MÃ©dicas', 'Any medical imaging modality typically used for diagnostic purposes. Enumerated type.', 'http://schema.org/MedicalEnumeration', '', 'http://schema.org/additionalType, http://schema.org/alternateName, http://schema.org/description, http://schema.org/disambiguatingDescription, http://schema.org/identifier, http://schema.org/image, http://schema.org/mainEntityOfPage, http://schema.org/name, http://schema.org/potentialAction, http://schema.org/sameAs, http://schema.org/supersededBy, http://schema.org/url', '', '', '', 'http://health-lifesci.schema.org'),
(393, 'http://schema.org/MedicalIndication', 'MedicalIndication', 'IndicaciÃ³n MÃ©dica', 'A condition or factor that indicates use of a medical therapy, including signs, symptoms, risk factors, anatomical states, etc.', 'http://schema.org/MedicalEntity', '', 'http://schema.org/additionalType, http://schema.org/alternateName, http://schema.org/code, http://schema.org/description, http://schema.org/disambiguatingDescription, http://schema.org/guideline, http://schema.org/identifier, http://schema.org/image, http://schema.org/legalStatus, http://schema.org/mainEntityOfPage, http://schema.org/medicineSystem, http://schema.org/name, http://schema.org/potentialAction, http://schema.org/recognizingAuthority, http://schema.org/relevantSpecialty, http://schema.org/sameAs, http://schema.org/study, http://schema.org/url', 'http://schema.org/ApprovedIndication, http://schema.org/PreventionIndication, http://schema.org/TreatmentIndication', '', '', 'http://health-lifesci.schema.org'),
