(395, 'http://schema.org/MedicalObservationalStudy', 'MedicalObservationalStudy', 'Estudio de ObservaciÃ³n MÃ©dica', 'An observational study is a type of medical study that attempts to infer the possible effect of a treatment through observation of a cohort of subjects over a period of time. In an observational study, the assignment of subjects into treatment groups versus control groups is outside the control of the investigator. This is in contrast with controlled studies, such as the randomized controlled trials represented by MedicalTrial, where each subject is randomly assigned to a treatment group or a control group before the start of the treatment.', 'http://schema.org/MedicalStudy', '', 'http://schema.org/additionalType, http://schema.org/alternateName, http://schema.org/code, http://schema.org/description, http://schema.org/disambiguatingDescription, http://schema.org/guideline, http://schema.org/healthCondition, http://schema.org/identifier, http://schema.org/image, http://schema.org/legalStatus, http://schema.org/mainEntityOfPage, http://schema.org/medicineSystem, http://schema.org/name, http://schema.org/outcome, http://schema.org/population, http://schema.org/potentialAction, http://schema.org/recognizingAuthority, http://schema.org/relevantSpecialty, http://schema.org/sameAs, http://schema.org/sponsor, http://schema.org/status, http://schema.org/study, http://schema.org/studyDesign, http://schema.org/studyLocation, http://schema.org/studySubject, http://schema.org/url', '', '', '', 'http://health-lifesci.schema.org'),
(396, 'http://schema.org/MedicalObservationalStudyDesign', 'MedicalObservationalStudyDesign', 'DiseÃ±o del Estudio de ObservaciÃ³n MÃ©dica', 'Design models for observational medical studies. Enumerated type.', 'http://schema.org/MedicalEnumeration', '', 'http://schema.org/additionalType, http://schema.org/alternateName, http://schema.org/description, http://schema.org/disambiguatingDescription, http://schema.org/identifier, http://schema.org/image, http://schema.org/mainEntityOfPage, http://schema.org/name, http://schema.org/potentialAction, http://schema.org/sameAs, http://schema.org/supersededBy, http://schema.org/url', '', '', '', 'http://health-lifesci.schema.org'),
