(400, 'http://schema.org/MedicalRiskCalculator', 'MedicalRiskCalculator', 'Calculadora de riesgo mÃ©dico', 'A complex mathematical calculation requiring an online calculator, used to assess prognosis. Note: use the url property of Thing to record any URLs for online calculators.', 'http://schema.org/MedicalRiskEstimator', '', 'http://schema.org/additionalType, http://schema.org/alternateName, http://schema.org/code, http://schema.org/description, http://schema.org/disambiguatingDescription, http://schema.org/estimatesRiskOf, http://schema.org/guideline, http://schema.org/identifier, http://schema.org/image, http://schema.org/includedRiskFactor, http://schema.org/legalStatus, http://schema.org/mainEntityOfPage, http://schema.org/medicineSystem, http://schema.org/name, http://schema.org/potentialAction, http://schema.org/recognizingAuthority, http://schema.org/relevantSpecialty, http://schema.org/sameAs, http://schema.org/study, http://schema.org/url', '', '', '', 'http://health-lifesci.schema.org'),
