(402, 'http://schema.org/MedicalRiskFactor', 'MedicalRiskFactor', 'Factor de Riesgo MÃ©dico', 'A risk factor is anything that increases a person\'s likelihood of developing or contracting a disease, medical condition, or complication.', 'http://schema.org/MedicalEntity', '', 'http://schema.org/additionalType, http://schema.org/alternateName, http://schema.org/code, http://schema.org/description, http://schema.org/disambiguatingDescription, http://schema.org/guideline, http://schema.org/identifier, http://schema.org/image, http://schema.org/increasesRiskOf, http://schema.org/legalStatus, http://schema.org/mainEntityOfPage, http://schema.org/medicineSystem, http://schema.org/name, http://schema.org/potentialAction, http://schema.org/recognizingAuthority, http://schema.org/relevantSpecialty, http://schema.org/sameAs, http://schema.org/study, http://schema.org/url', '', '', '', 'http://health-lifesci.schema.org'),
